te Landing Pages (Referrals)'=>'Партнерські лендінги (реферали)','Affiliate Login Form'=>'Форма входу в партнерську програму','Affiliate Orders'=>'Партнерські замовлення','Affiliate Orders (Referrals)'=>'Партнерські замовлення (реферали)','Affiliate Performance Bonuses'=>'Бонуси за ефективність партнерів','Affiliate Portal'=>'Партнерський портал','Affiliate Portal Logo'=>'Логотип партнерського порталу','Affiliate Portal URL: '=>'URL-адреса партнерського порталу: ','Affiliate Program - Signup Promo Page Generator'=>'Партнерська програма - генератор промо-сторінок реєстрації','Affiliate Program Invitation'=>'Запрошення до партнерської програми','Affiliate Program page has been updated successfully.'=>'Сторінка партнерської програми успішно оновлена.','Affiliate Referrer Coupon'=>'Купон від партнерського реферера','Affiliate Registration'=>'Реєстрація партнерів','Affiliate Registration Emails'=>'Електронні листи для реєстрації партнерів','Affiliate registration page'=>'Сторінка реєстрації партнерів','Affiliate registration will allow your users to easily register to become affiliate, and automatically create an affiliate coupon for them.'=>'Реєстрація партнера дозволить вашим користувачам легко зареєструватися, щоб стати партнером, і автоматично створити для них партнерський купон.','Affiliate Registration – Overview'=>'Реєстрація партнерів – огляд','Affiliate Registrations'=>'Реєстрація партнерів','Affiliate Reports Settings'=>'Налаштування партнерських звітів','Affiliate Statistics (Last 7 Days)'=>'Статистика партнерів (останні 7 днів)','Affiliate stats will be automatically refreshed when changing these statuses.'=>'Статистика партнерів буде автоматично оновлюватися при зміні цих статусів.','Affiliate store credit available'=>'Доступний кредит партнерського магазину','Affiliate User'=>'Афілійований користувач','Affiliate Username'=>'Ім\'я користувача партнера','Affiliate Users'=>'Афілійовані користувачі','Affiliate users will then just need to visit this page to see their affiliate dashboard.'=>'Потім афілійованим користувачам просто потрібно буде відвідати цю сторінку, щоб побачити інформаційну панель свого партнера.','Affiliates can link directly to your website via their website without needing an affiliate link.'=>'Партнери можуть посилатися безпосередньо на ваш веб-сайт через свій веб-сайт без необхідності партнерського посилання.','Affiliates can request payouts for coupons they are assigned to in the "Payouts" tab on the coupon affiliate dashboard page.'=>'Партнери можуть запросити виплати за купони, яким вони призначені, у вкладці «Виплати» на сторінці інформаційної панелі партнера з купонами.','Affiliates can select a payment method, then request and track payouts for unpaid commission, if they meet the threshold.'=>'Партнери можуть вибрати спосіб оплати, а потім запитувати та відстежувати виплати за несплачену комісію, якщо вони досягають порогу.','Align:'=>'Вирівняти:','All'=>'Увесь','All Bonuses'=>'Всі бонуси','All Campaigns'=>'Всі кампанії','All Categories'=>'Всі категорії','All Existing & New Customers'=>'Всі існуючі та нові клієнти','All Future Pro Features'=>'Усі майбутні функції Pro','All Groups & Roles'=>'Усі групи та ролі','All Roles'=>'Усі ролі','All Users'=>'Всі користувачі','All-Time'=>'За весь час','All-time'=>'За весь час','Allow admin accounts to view payouts tab (and request payouts) for all coupons.'=>'Дозвольте обліковим записам адміністраторів переглядати вкладку виплат (і запитувати виплати) для всіх купонів.','Allow administrator users to fill out the registration form for new users.'=>'Дозвольте користувачам адміністратора заповнювати реєстраційну форму для нових користувачів.','Allow affiliate user to apply their own coupon code at cart / checkout.'=>'Дозвольте афілійованому користувачеві застосовувати власний код купона в кошику / оформленні замовлення.','Allow affiliates to enter a custom payout amount.'=>'Дозвольте афіліатам вводити спеціальну суму виплати.','Allow affiliates to upload their invoice when requesting a payout for their unpaid commission.'=>'Дозвольте партнерам завантажувати свої рахунки-фактури, коли вони запитують виплату за несплачену комісію.','Allow logged out users to register as an affiliate.'=>'Дозвольте користувачам, які не ввійшли в систему, зареєструватися як партнер.','Allow multiple affiliate coupons to be used in the same order.'=>'Дозвольте використовувати кілька партнерських купонів в одному порядку.','Allow the affiliate to upload an invoice (PDF file) when requesting a payout.'=>'Дозвольте партнеру завантажувати рахунок-фактуру (PDF-файл) під час запиту виплати.','Allow your affiliates to create referral "campaigns" and then create custom URLs to track clicks/conversions per campaign.'=>'Дозвольте своїм партнерам створювати реферальні "кампанії", а потім створюйте користувацькі URL-адреси для відстеження кліків/конверсій у кожній кампанії.','Allow your affiliates to request commission payouts as "Store Credit" which they can use towards purchases in your store at checkout.'=>'Дозвольте своїм партнерам запитувати виплату комісійних як «Кредит магазину», який вони можуть використовувати для покупок у вашому магазині під час оформлення замовлення.','Allows you to set custom commission rates per user role. This will replace the settings set above, if it is set.'=>'Дозволяє встановлювати власні ставки комісійних для кожної ролі користувача. Це замінить параметри, встановлені вище, якщо вони встановлені.','Also block MANUAL use of affiliate coupons, if referred by a blocked domain.'=>'Також заблокуйте РУЧНЕ використання партнерських купонів, якщо вони перенаправлені заблокованим доменом.','Alt Text:'=>'Текст заміщення:','Alternatively, enable the option below to disable this field and generate a specific code automatically via a merge tag template.'=>'Крім того, увімкніть опцію нижче, щоб вимкнути це поле та автоматично згенерувати певний код за допомогою шаблону тега злиття.','Alternatively, you can allow affiliates to register as an affiliate. When accepted, this will then automatically create the coupon and assign them to it.'=>'Крім того, ви можете дозволити афілійованим особам реєструватися як партнери. Після прийняття це автоматично створить купон і призначить їх йому.','Always Enabled'=>'Завжди ввімкнено','Amount'=>'Кількість','Amount of orders to show on the affiliate dashboard by default.'=>'Кількість замовлень, які відображаються на інформаційній панелі партнера за замовчуванням.','An error occurred when attempting to reverse the Stripe payment.'=>'Помилка сталася під час спроби скасувати платіж Stripe.','An error occurred when attempting to send the Stripe payment.'=>'Під час спроби надіслати платіж Stripe сталася помилка.','An error occurred when attempting to send the Stripe payment. Please check your Stripe account.'=>'Під час спроби надіслати платіж Stripe сталася помилка. Будь ласка, перевірте свій обліковий запис Stripe.','and add or edit a coupon, then assign users under the "coupon affiliates" tab'=>'і додайте або відредагуйте купон, а потім призначте користувачів на вкладці «Партнери купонів»','and view the group ID here:'=>'та переглянути ідентифікатор групи тут:','API Key'=>'Ключ API','API URL'=>'URL-адреса API','APILayer API Key'=>'APILayer API ключ','apilayer.com'=>'apilayer.com','Apply %s credit to this order.'=>'Застосуйте кредит %s до цього замовлення.','Apply restrictions on when affiliate coupons can be used to help prevent affiliate fraud.'=>'Застосовуйте обмеження на те, коли можна використовувати партнерські купони, щоб запобігти шахрайству з боку партнерів.','Are shipping costs excluded from stats and calculations?'=>'Чи виключаються витрати на доставку зі статистики та розрахунків?','Are you sure you want to delete the'=>'Ви впевнені, що хочете видалити файл','Are you sure you want to delete this coupon?'=>'Ви впевнені, що хочете видалити цей купон?','Are you sure you want to delete this role?'=>'Ви впевнені, що хочете видалити цю роль?','Are you sure you want to refresh all this coupons affiliate dashboard data? The next time you visit the affiliate dashboard, it may take significantly longer to load (first visit).'=>'Ви впевнені, що хочете оновити всі ці дані інформаційної панелі партнерів за купонами? Наступного разу, коли ви відвідаєте інформаційну панель партнера, завантаження може зайняти значно більше часу (перше відвідування).','Are you sure you want to refresh the affiliate stats for this order? This will delete the current referral stats/commission and recalculate them.'=>'Ви впевнені, що хочете оновити статистику партнерів для цього замовлення? Це призведе до видалення поточної статистики/комісії рефералів та їх перерахунку.','Are you sure you want to remove this coupon from the order?'=>'Ви впевнені, що хочете видалити цей купон із замовлення?','as a template and enter the exact name of it below.'=>'як шаблон і введіть його точну назву нижче.','As an admin, you can also manually add new affiliate registrations easily in the "Registrations" admin page, via the "Create New Registration" button.'=>'Як адміністратор, ви також можете вручну легко додавати нові реєстрації партнерів на сторінці адміністратора «Реєстрації» за допомогою кнопки «Створити нову реєстрацію».','As an admin, you can then easily download/view the invoice in the admin "Payouts" list, found under a new "Files" column, before completing the payout.'=>'Як адміністратор, ви можете легко завантажити/переглянути рахунок-фактуру в адміністративному списку «Виплати», який знаходиться в новій колонці «Файли», перш ніж завершити виплату.','as normal in WooCommerce. You can then assign affiliate users to these coupons (see below) to make them an affiliate.'=>'як зазвичай у WooCommerce. Потім ви можете призначити афілійованим користувачам ці купони (див. нижче), щоб зробити їх партнерами.','As the parent affiliate, they will then earn a percentage of extra commission for all sales that their sub-affiliates refer to you.'=>'Як материнський партнер, 