ам ділитися своїми унікальними кодами купонів. Ці коди не тільки відстежують продажі для цілей комісії, але й пропонують клієнтам негайні знижки або спеціальні пропозиції, збагачуючи досвід покупки. Однак система Coupon Affiliates все ще зберігає гнучкість реферальних посилань; Партнери можуть ділитися URL-адресами, які автоматично застосовують їхній купон під час оформлення замовлення, і навіть якщо купон не використовується, ви <a href="%s" target="_blank">все одно можете змусити посилання самостійно відстежувати рефералів</a>, гарантуючи, що партнери отримують кредит за кожен перенаправлений продаж.','Coupon Affiliates for WooCommerce (PRO)'=>'Партнери з купонами для WooCommerce (PRO)','Coupon Affiliates: Activity Log'=>'Партнери з купонами: Журнал активності','Coupon Affiliates: Creatives'=>'Партнери за купонами: Креативи','Coupon Affiliates: Info & Help'=>'Партнери з купонами: інформація та допомога','Coupon Affiliates: PRO Modules'=>'Партнери з купонами: PRO-модулі','Coupon Affiliates: Setup Wizard'=>'Партнери з купонами: Майстер налаштування','Coupon Affiliates: Short URLs'=>'Партнери з купонами: короткі URL-адреси','Coupon Affiliates: Statements'=>'Партнери за купонами: заяви','Coupon Checkout Settings'=>'Налаштування оформлення замовлення купонів','Coupon Code'=>'Код купона','Coupon code already exists: '=>'Код купона вже існує: ','Coupon code successfully created:'=>'Код купона успішно створено:','Coupon code was not created. Template has not been selected.'=>'Код купона не був створений. Шаблон не вибрано.','Coupon Commission Settings'=>'Налаштування комісії за купони','Coupon Details'=>'Деталі купона','Coupon Format'=>'Формат купона','Coupon History Start Date'=>'Дата початку історії купонів','Coupon ID'=>'Ідентифікатор купона','Coupon ID:'=>'Ідентифікатор купона:','Coupon Info'=>'Інформація про купон','coupon list page'=>'Сторінка зі списком купонів','Coupon Name'=>'Назва купона','Coupon Title Prefix'=>'Префікс назви купона','Coupon Type'=>'Тип купона',