 більшості веб-сайтів налаштування на цій сторінці можна ігнорувати (залиште їх без змін).','For most websites, unless you are already using a 3rd party wallet plugin, we would suggest just using our free built-in wallet system.'=>'Для більшості веб-сайтів, якщо ви вже не використовуєте плагін 3rd party wallet, ми рекомендуємо просто використовувати нашу безкоштовну вбудовану систему гаманців.','For this to show, a user/affiliate account must be assigned to that coupon. The tab is only shown to this user.'=>'Щоб це відобразилося, на цей купон має бути призначено обліковий запис користувача/партнера. Вкладка відображається лише цьому користувачу.','Form CAPTCHA - Spam Protection'=>'Form CAPTCHA - Захист від спаму','Form ID'=>'Ідентифікатор форми','Form Style'=>'Стиль форми','Form Submission'=>'Відправка форми','Form Visibility Settings'=>'Налаштування видимості форми','Fraud'=>'Шахрайство','Fraud Prevention & Usage Restrictions'=>'Запобігання шахрайству та обмеження використання','Free Shipping'=>'Безкоштовна доставка','Free version can display reports for up to the past 1 month.'=>'Безкоштовна версія може відображати звіти за останній 1 місяць.','Free Version:'=>'Безкоштовна версія:','Frequency:'=>'Частота:','Frequently Asked Questions:'=>'Часто задавані питання:','From Email Address:'=>'З адреси електронної пошти:','From Name:'=>'З назви:','Full Name'=>'Прізвище, ім\'я, по батькові','funds have been added back to your Stripe account, and to the affiliates unpaid commission total.'=>'кошти були повернуті на ваш рахунок Stripe, а також до загальної суми невиплачених комісійних партнерів.','General'=>'Загальне','General Email Settings'=>'Загальні налаштування електронної пошти','General Questions'=>'Загальні питання','General Settings'=>'Загальні налаштування','Generally there should not be any reason to turn these off, but its here just incase, and for debugging.'=>'Як правило, не повинно бути жодних причин для їх відключення, але це тут про всяк випадок, і для налагодження.','Generate'=>'Генерувати','Generate & Edit Terms and Conditions'=>'Створення та редагування Умов та положень','Generate a new admin report'=>'Як створити новий звіт адміністратора','Generate a signup promo page that includes your program details and the registration form.'=>'Створіть промо-сторінку для реєстрації, яка містить деталі вашої програми та форму реєстрації.','Generate a unique coupon automatically.'=>'Згенеруйте унікальний купон автоматично.','Generate and edit the Terms & Conditions page for your affiliate program.'=>'Створіть та відредагуйте сторінку "Умови та положення" для вашої партнерської програми.','Generate and send an example report to yourself, with the settings/customisations you have set above.'=>'Створіть та надішліть приклад звіту собі, з налаштуваннями/налаштуваннями, які ви встановили вище.','Generate Coupon'=>'Згенерувати купон','Generate Dashboard Page'=>'Створити сторінку інформаційної панелі','Generate New Promo Page'=>'Згенеруйте нову промо-сторінку','GENERATE NEW REPORT'=>'СТВОРИТИ НОВИЙ ЗВІТ','Generate Promo Page'=>'Створити промо сторінку','Generate Registration Page'=>'Створити сторінку реєстрації','GENERATE REPORT'=>'СФОРМУВАТИ ЗВІТ','Generate some advanced detailed reports and analytics for your affiliate program.'=>'Створюйте розширені детальні звіти та аналітику для вашої партнерської програми.','Generating Report'=>'Формування звіту','Get priority support, and your suggestions will have more priority for development.'=>'Отримуйте пріоритетну підтримку, і ваші пропозиції матимуть більший пріоритет для розвитку.','Get Rates'=>'Отримати тарифи','GetResponse'=>'Отримати відповідь','Getting Started'=>'Знайомство','Give affiliates extra commission % as a bonus for selecting Store Credit as their payout method.'=>'Надайте партнерам додатковий % комісії як бонус за вибір кредиту в магазині як методу виплати.','Give unpaid commission to affiliate.'=>'Надайте невиплачену комісію партнеру.','Give your affiliates bonuses when they reach certain goals, such as some bonus commission once they reach a certain amount of sales.'=>'Надавайте своїм партнерам бонуси, коли вони досягають певних цілей, наприклад, бонусну комісію, коли вони досягають певної суми продажів.','Give your affiliates lifetime commission for ALL future purchases from all their referred users.'=>'Надайте своїм партнерам довічну комісію за ВСІ майбутні покупки від усіх їхніх залучених користувачів.','Go to Page'=>'Перейти на сторінку','Go to Settings'=>'Перейдіть до Параметрів','Go to settings'=>'Перейдіть до налаштувань','Go to the'=>'Перейдіть до розділу','Go to the <a href="%s" target="_blank">Add New Affiliate</a> page to add new affiliates here, which will automatically generate the coupon code for them.'=>'Перейдіть на сторінку <a href="%s" target="_blank">«Додати нового партнера</a> », щоб додати сюди нових партнерів, які автоматично згенерують для них код купона.','Google reCAPTCHA'=>'Google reCAPTCHA','Group / Role'=>'Група / Роль','Group Display Name'=>'Коротке ім\'я групи','Group does not exist.'=>'Групи не існує.','Group ID'=>'Ідентифікатор групи','Group updated successfully.'=>'Група успішно оновилася.','has been paid into your connected Stripe account.'=>'було внесено на ваш підключений обліковий запис Stripe.','has been paid to'=>'було виплачено','has been reversed.'=>'було скасовано.','Help'=>'Допомога','Help Area'=>'Зона допомоги','Help Documentation'=>'Довідкова документація','Here is a video guide explaining how to get started with the plugin'=>'Ось відеоінструкція, яка пояснює, як розпочати роботу з плагіном','Here\'s some of the next steps you can take:'=>'Ось деякі з наступних кроків, які ви можете зробити:','Hi {first_name}, Congratulations, you have just earned a reward! View your affiliate dashboard for more details.'=>'Привіт {first_name}, Вітаємо, ви щойно отримали нагороду! Перегляньте інформаційну панель партнера для отримання більш детальної інформації.','Hide'=>'Приховати','Hide "0.00" value on checkout from referral coupons.'=>'Приховайте значення "0,00" під час оформлення замовлення з реферальних купонів.','Hide commission statistics for non-affiliate coupons.'=>'Приховуйте статистику комісійних за непартнерські купони.','Hide link for non-affiliate users.'=>'Приховати посилання для користувачів, які не є афіліатами.','Hide Parent Product'=>'Сховати батьківський продукт','Hide the "all-time" stats on statistics tab and line graph.'=>'Приховайте статистику за весь час на вкладці статистики та лінійному графіку.','Hide the "Coupon code applied successfully." message on all pages except for the cart/checkout pages.'=>'Приховайте повідомлення «Код купона успішно застосовано» на всіх сторінках, крім сторінок кошика/оформлення замовлення.','Horizontal Margin (X):'=>'Горизонтальне поле (X):','How are referral URLs generated?'=>'Як генеруються URL-адреси переходів?','How did you hear about us?'=>'Як ви про нас дізналися?','How do I apply custom tax adjustments to stats and commission?'=>'Як застосувати спеціальні податкові коригування до статистики та комісій?','How do I change commission rates for new orders only?'=>'Як змінити ставки комісії тільки за нові замовлення?','How do I create affiliate users?'=>'Як створити афілійованих користувачів?','How do I get support?'=>'Як отримати підтримку?','How do I give affiliate users access to their own dashboard?'=>'Як надати афілійованим користувачам доступ до власної інформаційної панелі?','How do I include or exclude tax/VAT from stats and commission?'=>'Як включити або виключити податок/ПДВ зі статистики та комісії?','How do I manually connect an affiliate to an existing customer as a lifetime affiliate?'=>'Як вручну підключити афіліату до існуючого клієнта як довічного партнера?','How do I only show “completed” orders on affiliate dashboard?'=>'Як я можу показувати лише «виконані» замовлення на інформаційній панелі партнера?','How do I pay my affiliates?'=>'Як я можу оплатити свої партнери?','How many creatives to show per row (on larger screens). Recommended between 2 - 4. On mobile devices this will be responsive, and only shows 1 per row.'=>'Скільки креативів показувати в рядку (на великих екранах). Рекомендується від 2 до 4. На мобільних пристроях цей параметр буде адаптивним і показуватиме лише 1 символ у рядку.','How many days after being assigned as a "lifetime" referral should it expire, and the customer be unlinked from the customer. Leave empty to use the default global setting. Set to "0" for permanent lifetime commission with no expiry time.'=>'Скільки днів після призначення як «довічного» реферала має закінчитися, а клієнт має бути від\'єднаний від клієнта. Залиште порожнім, щоб використовувати глобальне налаштування за замовчуванням. Встановлено на "0" для постійної довічної комісії без терміну дії.','How many months to show on the "monthly summary" table by default.'=>'Скільки місяців відображати в таблиці "щомісячний підсумок" за замовчуванням.','How many of this product would you like to reward the affiliate with?'=>'Скільки цього продукту ви хотіли б нагородити партнеру?','How much "unpaid commission" must be earned/available, before the affiliate can request a payout.'=>'Скільки "невиплаченої комісії" має бути зароблено/доступно, перш ніж партнер зможе запросити виплату.','How often should a report be sent to affiliates via email?'=>'Як часто потрібно надсилати звіт афіліатам електронною поштою?','How often should payout requests be checked & submitted automatically?'=>'Як часто потрібно перевіряти та подавати запити на виплати автоматично?','How to assign affiliate users to coupons'=>'Як призначити афілійованим користувачам купони','How to customize the affiliate registration form?'=>'Як налаштувати форму реєстрації партнера?','How to exclude specific products from commission?'=>'Як виключити конкретні товари з комісії?','How to export affiliate reports in WooCommerce?'=>'Як експортувати партнерські звіти в WooCommerce?','How to fix “ERROR: Failed to load ajax request.”'=>'Як виправити "ПОМИЛКА: Не вдалося завантажити запит ajax."','How To Get Started'=>'З чого почати','How to set up tiered affiliate commissions?'=>'Як налаштувати багаторівневі партнерські комісії?','How to track affiliate sales and commissions in WooCommerce?'=>'Як відстежувати партнерські продажі та комісійні в WooCommerce?','How to track coupon usage in WooCommerce?'=>'Як відстежувати використання купонів у WooCommerce?','How to use the Coupon Usage Tracker plugin?'=>'Як користуватися плагіном Coupon Usage Tracker?','How will you promote us?'=>'Як ви будете нас просувати?','However, if preferred, you can use a 3rd party wallet plugin for the store credit payouts. This does however require more setup work, and an additional integration plugin.'=>'Однак, якщо бажаєте, ви можете використовувати плагін 3rd party wallet для виплат кредитів у магазині. Однак це вимагає додаткової роботи з налаштування та додаткового плагіна інтеграції.','https://couponaffiliates.com'=>'https://couponaffiliates.com','https://couponaffiliates.com/'=>'https://couponaffiliates.com/','Icon Colour'=>'Колір іконки','Icons'=>'Іконки','ID'=>'Ідентифікатор','Ideally you should only enable "completed" order statuses above if you have "Completed Date" selected.'=>'В ідеалі ви повинні включати статуси "виконаних" замовлень тільки вище, якщо у вас вибрана "Дата завершення".','If an order is created using an affiliates coupon, then marked as completed, the commission will be added to the affiliate account as "unpaid commission".'=>'Якщо ордер створений з використанням партнерського купона, а потім позначений як виконаний, комісія буде додана на партнерський рахунок як «невиплачена комісія».','If an order is refunded then the commission will be removed from the users account.'=>'Якщо замовлення повертається, то комісія буде знята з облікового запису користувача.','If at-least 1 role is selected, this payout method will only be available for the selected user roles. If none are selected it will be available for all roles.'=>'Якщо вибрано принаймні 1 роль, цей спосіб отримання виплат буде доступний лише для вибраних ролей користувачів. Якщо жодна з них не буде обрана, вона буде доступна для всіх ролей.','If automatic payouts are enabled, this will also trigger the automated payout for Stripe, PayPal and Store Credit.'=>'Якщо ввімкнено автоматичні виплати, це також активує автоматичну виплату для Stripe, PayPal і Store Credit.','If cookies are disabled, the referral links will still work but will not be as effective, since they can only attempt to auto-apply coupons on the first page they load.'=>'Якщо файли cookie відключені, реферальні посилання все одно працюватимуть, але не будуть такими ефективними, оскільки вони можуть намагатися автоматично застосувати купони лише на першій завантаженій сторінці.','If disabled, by default the referral will only be tracked if the customer applys the affiliates coupon when placing their order.'=>'Якщо вимкнено, за замовчуванням реферал буде відстежуватися лише в тому випадку, якщо клієнт застосує купон афіліатів під час розміщення свого замовлення.','If disabled, it will instead store an extra random ID as a cookie for new referral clicks ("wcusage_referral_id") which will then work in the same way.'=>'Якщо цей параметр вимкнено, він натомість зберігатиме додатковий випадковий ідентифікатор як файл cookie для нових кліків переходів («wcusage_referral_id»), який потім працюватиме таким же чином.','If disabled, only the first click from the visitor will be tracked (until the cookie expires).'=>'Якщо вимкнено, то відстежуватиметься лише перший клік від відвідувача (до закінчення терміну дії файлу cookie).','If disabled, only the parent (first) order for the subscription will earn commission.'=>'Якщо цей параметр вимкнено, комісію отримуватиме лише батьківське (перше) замовлення на підписку.','If disabled, only the parent product will be shown - and variations that have per-variation commission rates set different to the parent.'=>'Якщо цей параметр вимкнено, відображатиметься лише батьківський продукт, а також варіанти, ставки комісії за кожен варіант яких відрізняються від батьківського.','If disabled, the parent product will be shown in the table.'=>'Якщо цей параметр вимкнено, у таблиці буде показано батьківський продукт.','If disabled, then it will only be able to try to automatically apply the coupon code on their first page visit, and URL only conversion tracking will not work. Coupons will be required to track referrals.'=>'Якщо вимкнено, то він зможе лише намагатися автоматично застосувати код купона під час першого відвідування сторінки, а відстеження конверсій лише за URL-адресою не працюватиме. Купони будуть потрібні для відстеження рефералів.','If enabled below, the referral link will automatically apply the coupon code to their cart.'=>'Якщо ввімкнено нижче, реферальне посилання автоматично застосує код купона до кошика.','If enabled, all new referral URL clicks from the same user will be tracked (and increases total clicks + visit logged in click history). Only the latest click will be converted if they make a purchase.'=>'Якщо цей параметр увімкнено, то відстежуватимуться всі нові кліки за URL-посиланнями переходів від того самого користувача (і збільшується загальна кількість кліків + історія відвідувань, що увійшли в систему). Лише останній клік буде конвертовано, якщо він здійснить покупку.','If enabled, all variations of a product will be shown in the table as seperate rows.'=>'Якщо цей параметр увімкнено, то всі варіанти товару будуть відображатися в таблиці окремими рядками.','If enabled, an option will be displayed in the affiliate dashboard settings tab, allowing affiliates to turn off the email reports.'=>'Якщо увімкнено, на вкладці налаштувань інформаційної панелі партнерів буде відображатися опція, що дозволить афіліатам вимкнути звіти електронною поштою.','If enabled, if someone visits the site via the referral URL and places an order without using the coupon code, it will still be tracked and award the affiliate.'=>'Якщо увімкнено, якщо хтось відвідує сайт через реферальну URL-адресу та розміщує замовлення без використання коду купона, він все одно буде відстежуватися та нагороджувати партнера.','If enabled, order tax will be added to the fixed commission calculations.'=>'Якщо увімкнено, податок на замовлення буде додано до фіксованих розрахунків комісії.','If enabled, order tax will be added to the order subtotal/total/discount for orders in the statistics, and when calculating percentage (%) commission calculations.'=>'Якщо увімкнено, то податок на замовлення буде додаватися до проміжного підсумку/всього/знижки замовлень у статистиці, а при розрахунку відсотка (%) розрахунку комісії.','If enabled, the "MLA Dashboard" will only be accessible to specific affiliate users that you give access to (edit the user and enable "MLA Dashboard Access").'=>'Якщо цей параметр увімкнено, «Панель керування MLA» буде доступна лише конкретним афілійованим користувачам, до яких ви надаєте доступ (відредагуйте користувача та включіть «Доступ до панелі керування MLA»).','If enabled, the affiliate reports will be turned on by default for all affiliate users (if they have not yet updated the setting). They can toggle this off in the settings tab of their dashboard. If disabled, then the reports will be turned off by default, and the affiliate user will need to toggle it on to receive the reports.'=>'Якщо увімкнено, партнерські звіти будуть увімкнені за замовчуванням для всіх користувачів-афіліатів (якщо вони ще не оновили налаштування). Вони можуть вимкнути це на вкладці налаштувань на своїй інформаційній панелі. Якщо вимкнено, то звіти будуть вимкнені за замовчуванням, а партнерському користувачеві потрібно буде увімкнути їх, щоб отримувати звіти.','If enabled, the first time a new dynamic creative is generated for an affiliate, this will be cached for 24 hours, unless the creative is updated. This results better performance and less resource usage.'=>'Якщо цей параметр увімкнено, то під час першого генерування нового динамічного креативу для афіліату він буде кешуватися протягом 24 годин, якщо креатив не буде оновлено. Це призводить до кращої продуктивності та меншого використання ресурсів.','If enabled, the parent product will be hidden from the table if at-least 1 variation.'=>'Якщо увімкнено, батьківський продукт буде приховано з таблиці, якщо принаймні 1 варіант.','If enabled, the plugin will attempt to apply the code on the first page they visit. If disabled, it will only apply the code once they visit the cart/checkout pages.'=>'Якщо увімкнено, плагін спробує застосувати код на першій сторінці, яку він відвідує. Якщо цей параметр вимкнено, код застосовуватиметься лише після відвідування сторінок кошика/оформлення замовлення.','If enabled, the tracking cookies will be deleted from the customers browser, once the order is completed.'=>'Якщо цей параметр увімкнено, файли cookie для відстеження будуть видалені з браузера клієнта після завершення замовлення.','If enabled, then the registration form shortcode will be disabled/hidden for any affiliate user that is already assigned to an affiliate coupon.'=>'Якщо увімкнено, то шорткод форми реєстрації буде вимкнено/приховано для будь-якого афілійованого користувача, якому вже призначено партнерський купон.','If enabled, when uninstalling (deleting) the plugin, most plugin options and custom tables/data created by this plugin will be deleted. Some data will still remain such as custom order & coupon meta data (if any).'=>'Якщо увімкнено, то при видаленні (видаленні) плагіна більшість опцій плагіна та користувацькі таблиці/дані, створені цим плагіном, будуть видалені. Деякі дані все одно залишаться, наприклад метадані спеціального замовлення та купонів (якщо такі є).','If enabled, whenever a new user is created (in any way), an affiliate registration will also be submitted for them automatically.'=>'Якщо увімкнено, щоразу, коли створюється новий користувач (будь-яким чином), реєстрація партнера також буде подана для нього автоматично.','If enabled, you can select which payout methods should be used for scheduled payouts.'=>'Якщо цей параметр увімкнено, ви можете вибрати, які методи виплат слід використовувати для запланованих виплат.','If for some reason the user deletes/removes the coupon manually from their cart, the cookie will also be removed.'=>'Якщо з якихось причин користувач видалить/видалить купон вручну зі свого кошика, файл cookie також буде видалено.','If needed, you can <a href="%s" target="_blank">make the link alone track referrals</a> without requiring the affiliates coupon to be applied, ensuring affiliates receive credit for every sale referred.'=>'Якщо потрібно, ви можете <a href="%s" target="_blank">зробити посилання самостійно відстежувати рефералів</a> , не вимагаючи застосування купона від партнерів, гарантуючи, що афіліати отримують кредит за кожен перенаправлений продаж.','If no roles are selected, the tab will be visible to all affiliates.'=>'Якщо не вибрано жодної ролі, вкладка буде видимою для всіх афіліатів.','If none are selected all will have access. This is the user roles that will be able to earn and view this reward.'=>'Якщо не вибрано жодного, доступ матимуть усі користувачі. Саме ці ролі користувачів зможуть заробляти та переглядати цю винагороду.','If preferred you can disable cookies completely in the'=>'Якщо це бажано, ви можете повністю вимкнути файли cookie в розділі','If preferred, you can enable "New Customers Only" for individual coupons in the "Usage limits" coupon settings tab.'=>'Якщо бажано, ви можете ввімкнути «Лише для нових клієнтів» для окремих купонів у вкладці налаштувань купонів «Ліміти використання».','If set to "0" then commission will be added to the affiliates account instantly when an order is completed.'=>'Якщо встановлено значення "0", то комісія буде зарахована на рахунок афіліатів миттєво при виконанні ордера.','If the affiliate does not enter a custom URL, this will be used as the default landing page for the link.'=>'Якщо партнер не введе користувацьку URL-адресу, вона буде використовуватися як цільова сторінка за замовчуванням для посилання.','If the affiliate user is assigned to multiple user roles, it will apply the commission rates for the first role it detects with any custom values set.'=>'Якщо афілійований користувач призначений на кілька ролей користувача, він застосує ставки комісії для першої ролі, яку він виявить, з будь-якими встановленими користувацькими значеннями.','If the affiliates coupon'=>'Якщо купон від партнерів','If the checkbox is selected below, this user has been granted this award/bonus.'=>'Якщо прапорець встановлений нижче, цей користувач отримав цю нагороду/бонус.','If the portal is enabled, all affiliate dashboard links will direct the affiliate to the portal page, instead of the regular dashboard page.'=>'Якщо портал увімкнено, усі посилання на інформаційній панелі партнера спрямовуватимуть партнера на сторінку порталу, а не на звичайну сторінку інформаційної панелі.','If the referral URL is clicked, the coupon code will automatically be applied to the users checkout. The coupon must be used for commission to be tracked.'=>'Якщо ви натиснете на URL-адресу реферала, код купона буде автоматично застосовано до оформлення замовлення користувача. Купон повинен бути використаний для відстеження комісії.','If the user does not exist, a new one will be created.'=>'Якщо користувача не існує, буде створено нового.','If the user is an admin, then the ID will also be clickable to open the order page in the backend.'=>'Якщо користувач є адміністратором, то ID також буде клікабельним, щоб відкрити сторінку замовлення в бекенді.','If the user is not already registered as an affiliate and has no active coupons, this will show the registration from on the affiliate dashboard page.'=>'Якщо користувач ще не зареєстрований як партнер і не має активних купонів, це покаже реєстрацію на сторінці інформаційної панелі партнера.','If there are no landing pages assigned to the coupon, then this will be hidden.'=>'Якщо на купон не призначено посадкових сторінок, то це буде приховано.','If this is disabled, then it will only be able to try to track referrals if they register on their first page visit.'=>'Якщо це вимкнено, то він зможе намагатися відстежувати рефералів лише в тому випадку, якщо вони реєструються під час першого відвідування сторінки.','If this is your first time loading this dashboard, and it\'s a large coupon, it may take a little while to load.'=>'Якщо ви вперше завантажуєте цю інформаційну панель, і це великий купон, завантаження може зайняти деякий час.','If you are experiencing any performance issues or other bugs with the plugin, please try enabling/disabling relevant settings below.'=>'Якщо у вас виникли проблеми з продуктивністю або інші помилки плагіна, спробуйте включити/вимкнути відповідні налаштування нижче.','If you are getting the "Failed to load ajax request" error on the affiliate dashboard'=>'Якщо ви отримуєте помилку «Не вдалося завантажити запит ajax» на дашборді партнера','If you do not want past orders to be affected when commission stats are refreshed, you can enable this in the'=>'Якщо ви не хочете, щоб це вплинуло на минулі замовлення при оновленні статистики комісій, ви можете увімкнути це в розділі','If you dont want the message to always show, toggle this setting on, and it will instead only show on the cart/checkout pages.'=>'Якщо ви не хочете, щоб повідомлення завжди відображалося, увімкніть цей параметр, і воно відображатиметься лише на сторінках кошика/оформлення замовлення.','If you experience very high volumes of orders for each coupon, this should help greately with affiliate dashboard speed/performance.'=>'Якщо ви стикаєтеся з дуже великими обсягами замовлень за кожним купоном, це має значно допомогти зі швидкістю/ефективністю партнерської інформаційної панелі.','If you have any suggestions for new types of bonus requirements or rewards, <a href="%s" target="_blank">please let us know</a>.'=>'Якщо у вас є пропозиції щодо нових типів вимог до бонусів або винагород, <a href="%s" target="_blank">будь ласка, повідомте нам</a>.','If you have lots of affiliates, we highly recommend using an SMTP Service Provider via the FluentSMTP plugin for more reliable email delivery.'=>'Якщо у вас багато філій, ми настійно рекомендуємо використовувати постачальника послуг SMTP через плагін FluentSMTP для більш надійної доставки електронної пошти.','If you need help getting started, or have any questions at all, you can <a href="%s">create a support ticket</a> any time, and we will be happy to help.'=>'Якщо вам потрібна допомога на початку роботи, або у вас взагалі виникли питання, ви можете <a href="%s">створити запит до служби підтримки</a> в будь-який час, і ми з радістю допоможемо.','If you need to use a different base currency (%s), you will need to upgrade to the "Basic" API plan.'=>'Якщо вам потрібно використовувати іншу базову валюту (%s), вам потрібно буде перейти на "Базовий" план API.','If you set custom "coupon" commission for that affiliate, or "per product" commission, they WILL take priority over the "user role" commission.'=>'Якщо ви встановите спеціальну комісію "купон" для цього партнера або комісію "за продукт", вони МАТИМУТЬ пріоритет над комісією "роль користувача".','If you want conversions to be tracked even if the coupon is not used, enable the setting below under "URL Conversion Tracking".'=>'Якщо ви хочете, щоб конверсії відстежувалися, навіть якщо купон не використовується, увімкніть налаштування нижче в розділі "Відстеження конверсій URL".','If you want to automatically give access to the MLA Dashboard for certain user roles, select them below.'=>'Якщо ви хочете автоматично надавати доступ до панелі MLA Dashboard для певних ролей користувачів, виберіть їх нижче.','If you want to change the text "Coupon" to something else on the checkout page, enable this option and enter the custom text below.'=>'Якщо ви хочете змінити текст "Купон" на щось інше на сторінці оформлення замовлення, увімкніть цю опцію та введіть користувацький текст нижче.','If you want to show the logged in users current store credit balance somewhere, use the shortcode'=>'Якщо ви хочете десь показати поточний баланс кредиту в магазині зареєстрованих користувачів, скористайтеся шорткодом','If you wish to manually submit payout request for your affiliates, you can do so from this page. After submitting a payout request, you will be redirected to the "Payouts" page to view, manage and finalize the payout.'=>'Якщо ви хочете вручну надіслати запит на виплати для своїх партнерів, ви можете зробити це на цій сторінці. Після подання запиту на виплату ви будете перенаправлені на сторінку «Виплати» для перегляду, керування та завершення виплати.','Image'=>'Образ','Image:'=>'Образ:','Import / Export Custom Tables'=>'Імпорт / експорт користувальницьких таблиць','Import and Export the custom database tables created by this plugin.'=>'Імпортуйте та експортуйте користувацькі таблиці бази даних, створені за допомогою цього плагіна.','Import/Export Custom Tables'=>'Імпорт/експорт користувальницьких таблиць','Important: If your short URLs show a 404 page after changing this, you may need to go to the "Settings > Permalinks" page and click "Save Changes" to refresh your permalinks.'=>'Важливо: якщо після зміни ваших коротких URL-адрес відображається сторінка 404, вам може знадобитися перейти на сторінку "Налаштування > постійні посилання" та натиснути "Зберегти зміни", щоб оновити постійні посилання.','Important: There are some cases where direct link tracking may not be detected properly.'=>'Важливо: у деяких випадках відстеження прямих посилань може не виявлятися належним чином.','Important: This is only recommended if you experience high levels of affiliate fraud, and/or want a strict way to help stop unauthorized referrals.'=>'Важливо: Це рекомендується лише в тому випадку, якщо ви зіткнулися з високим рівнем шахрайства з боку партнерів та/або вам потрібен суворий спосіб зупинити неавторизованих перенаправлень.','Important: This needs to be different to your normal affiliate referral URL prefix.'=>'Важливо: цей параметр має відрізнятися від звичайного префікса URL-адреси рефералів партнера.','in'=>'В','In most cases PayPal Payouts fees are 2%.'=>'У більшості випадків комісія за виплати PayPal становить 2%.','In the affiliate report, stats will be shown/calculated based on the previous date range. So monthly reports will show stats from the previous month.'=>'У партнерському звіті статистика буде показана/розрахована на основі попереднього діапазону дат. Тож щомісячні звіти показуватимуть статистику за попередній місяць.','In this preview, example values are used for the merge tags if the coupon code entered does not exist:'=>'У цьому попередньому перегляді для тегів злиття використовуються приклади значень, якщо введеного коду купона не існує:','In this section, you can create your own custom tabs to show on the affiliate dashboard. Shortcode usage supported.'=>'У цьому розділі ви можете створити власні користувацькі вкладки для відображення на інформаційній панелі партнера. Підтримується використання шорткоду.','In this section, you can manage multi-currency settings, if you are using a multi currency plugin.'=>'У цьому розділі ви можете керувати налаштуваннями мультивалютності, якщо ви використовуєте плагін для кількох валют.','Include "custom discounts" in % commission calculations & order totals.'=>'Включіть «спеціальні знижки» в розрахунок % комісії та загальну суму замовлень.','Include "fees" in % commission calculations & order totals.'=>'Включіть "збори" в % розрахунку комісії та загальну суму замовлень.','Include "shipping costs" in % commission calculations & order totals.'=>'Включіть «вартість доставки» в розрахунок % комісії та загальну суму замовлень.','Include "taxes" in "fixed" commission calculations.'=>'Включайте