n ID has been selected.'=>'Ідентифікатор купона не вибрано.','No coupons were used for this order.'=>'Для цього замовлення не використовувалися купони.','No creatives are available for this group.'=>'Для цієї групи немає креативів.','No data available for this tab.'=>'Для цієї вкладки немає доступних даних.','No Default'=>'Без дефолту','No Discount'=>'Без знижки','No new affiliate coupons found.'=>'Нових партнерських купонів не знайдено.','No orders found.'=>'Замовлень не знайдено.','No payout methods are available currently.'=>'Наразі способи виплат недоступні.','No products found.'=>'Товарів не знайдено.','No recent activity found.'=>'Остання активність не виявлена.','No recent clicks found.'=>'Останніх кліків не знайдено.','No recent payouts found.'=>'Нещодавніх виплат не виявлено.','No recent referral orders found.'=>'Нещодавніх реферальних замовлень не знайдено.','No recent registrations found.'=>'Останніх реєстрацій не знайдено.','No role specified.'=>'Роль не вказана.','No template coupons assigned.'=>'Шаблонні купони не призначено.','Non-Affiliate Coupon Settings'=>'Налаштування купонів не для партнерів','Normal'=>'Нормальний','Normally it will just show the coupon name, discount, usage, and button to direct them to the unique URL ID, for the affiliate dashboard for that coupon.'=>'Зазвичай він просто показує назву купона, знижку, використання та кнопку, щоб направити їх на унікальний ідентифікатор URL-адреси для інформаційної панелі партнера для цього купона.','Not Connected'=>'Не підключено','Not Converted'=>'Не конвертовано','Note:'=>'Примітка:','Note: "Unpaid Commission" will start from "0" and will only start tracking after you installed the "PRO" version and activated the payouts functionality.'=>'Примітка: «Несплачена комісія» почнеться з «0» і почне відслідковуватися лише після того, як ви встановили версію «PRO» та активували функцію виплат.','Note: Changing these tax settings will affect stats for all coupons and all new/past orders. Stats are refreshed next time there is a new order (for that specific coupon), or you click the "refresh all data" button in "debug" settings to refresh ALL coupon stats.'=>'Примітка: Зміна цих налаштувань податків вплине на статистику всіх купонів і всіх нових/минулих замовлень. Статистика оновлюється наступного разу, коли з\'являється нове замовлення (для цього конкретного купона), або ви натискаєте кнопку «оновити всі дані» в налаштуваннях «налагодження», щоб оновити ВСЮ статистику купонів.','Note: Currently only the "EUR" base store currency is supported on the free API plan.'=>'Примітка: Наразі в безкоштовному плані API підтримується лише валюта базового магазину "EUR".','Note: If enabled, any new clicks (from the same visitor) within the same minute as another will not be logged, and will keep the same ID as the initial click (to prevent spamming the logs).'=>'Примітка: Якщо цей параметр увімкнено, будь-які нові кліки (від того ж відвідувача) протягом тієї ж хвилини, що й інший, не реєструватимуться, і зберігатимуться той самий ідентифікатор, що й початковий клік (щоб запобігти розсиланню спаму в журналах).','Note: If required, you can customise more calculation settings in the plugin settings page.'=>'Примітка: Якщо потрібно, ви можете налаштувати додаткові параметри розрахунку на сторінці налаштувань плагіна.','NOTE: If set to "Completed Date", only orders that have been marked as "completed" (at-least once) can be displayed on the dashboard.'=>'ПРИМІТКА: Якщо встановлено "Дата завершення", на інформаційній панелі можуть відображатися лише замовлення, які були позначені як "завершені" (принаймні один раз).','Note: If statements are showing "page not found", simply click save in your'=>'Примітка: Якщо твердження показують "сторінку не знайдено", просто натисніть зберегти у своєму','Note: If you edit this, any previous short URLs created by your affiliates (with the old slug) will stop working.'=>'Примітка: якщо ви відредагуєте це, будь-які попередні короткі URL-адреси, створені вашими афіліатами (зі старим slug), перестануть працювати.','NOTE: In some rare cases, or certain themes, this option may not work and will show the "loading..." animation continuously. In this case, simply disable it or contact us to look into fixing it for you.'=>'ПРИМІТКА: У деяких рідкісних випадках або певних темах ця опція може не працювати і покаже "завантаження..." анімація безперервно. У цьому випадку просто вимкніть його або зв\'яжіться з нами, щоб розглянути можливість вирішення цього для вас.','Note: Payouts can only be made if you have the required funds in your PayPal account.'=>'Примітка: Виплати можуть бути здійснені лише за наявності необхідних коштів на вашому обліковому записі PayPal.','Note: Payouts can only be made if you have the required funds in your Stripe account.'=>'Примітка: виплати можуть бути здійснені лише за наявності необхідних коштів на вашому рахунку Stripe.','Note: There are lots more options available in the settings page.'=>'Примітка: На сторінці налаштувань доступно набагато більше опцій.','Note: This is an integration for a 3rd-party plugin. We are not affiliated with, and do not have any control over the features and functionality offered by the "%s" plugin.'=>'Примітка: Це інтеграція для плагіна 3rd-party. Ми не пов\'язані з плагіном "%s" і не маємо жодного контролю над функціями та функціональними можливостями, які пропонує плагін "%s".','Note: This will only show for users that are not currently assigned to any affiliate coupons. They must also be logged in, or have selected "Create an account?" for it to show.'=>'Примітка: Це буде показано лише для користувачів, яким наразі не призначено жодних партнерських купонів. Вони також повинні увійти в систему або вибрати «Створити обліковий запис?», щоб він відображався.','NOTE: Updating the conversion rates below will only update the totals for NEW orders (if the affiliate dashboard has been viewed at-least once).'=>'ПРИМІТКА: Оновлення коефіцієнтів конверсії нижче оновить загальну суму лише для НОВИХ замовлень (якщо панель партнерської панелі була переглянута хоча б один раз).','Note: We recommended using'=>'Примітка: Ми рекомендуємо використовувати','Note: When enabled, any existing orders that do not currently have a conversion rate set, will save the rate as the rate set below (when the affiliate dashboard is next loaded).'=>'Примітка: Коли увімкнено, будь-які існуючі ордери, які наразі не мають встановленого коефіцієнта конверсії, збережуть ставку як ставку, встановлену нижче (під час наступного завантаження партнерської інформаційної панелі).','Note: When updating these settings saved data will be refreshed for all dashboards automatically (first page load may take longer).'=>'Примітка: При оновленні цих налаштувань збережені дані будуть оновлюватися для всіх інформаційних панелей автоматично (перше завантаження сторінки може зайняти більше часу).','Note: You can customise some other email notifications on the plugin settings page later if needed.'=>'Примітка: Ви можете налаштувати деякі інші сповіщення електронною поштою на сторінці налаштувань плагіна пізніше, якщо це необхідно.','Note: You can customise the registration system more in the plugin settings page.'=>'Примітка: Ви можете налаштувати систему реєстрації більше на сторінці налаштувань плагіна.','Note: Your users can also register themselves as affiliates using the <a href="%s" target="_blank">affiliate registration form</a>.'=>'Примітка: Ваші користувачі також можуть зареєструватися як афіліати за допомогою <a href="%s" target="_blank">форми реєстрації партнера</a>.','Notice (admin only): Page constantly loading? Try refreshing the page.'=>'Повідомлення (лише для адміністратора): Сторінка постійно завантажується? Спробуйте оновити сторінку.','Notifications Settings'=>'Налаштування сповіщень','Number of Custom Fields'=>'Кількість користувацьких полів','Number of custom tabs'=>'Кількість користувацьких вкладок','Number of days the referral cookie is stored'=>'Кількіст