l tracking cookies when customer places an order.'=>'Видаляйте всі файли cookie для відстеження, коли клієнт розміщує замовлення.','Remove coupon ID from unique coupon dashboard URLs.'=>'Видаліть ідентифікатор купона з унікальних URL-адрес інформаційної панелі купонів.','Remove from Blacklist'=>'Видалити з чорного списку','Remove the pending affiliate role from user when their affiliate application is accepted.'=>'Видаліть у користувача роль партнера, що очікує на розгляд, коли його партнерська заявка буде прийнята.','Report Complete!'=>'Звіт завершено!','Report created for'=>'Звіт створено для','Report Details'=>'Деталі звіту','Report Title'=>'Назва звіту','Reporting'=>'Звітності','Reports'=>'Звіти','Reports & Analytics'=>'Звіти та аналітика','Reports will be automatically scheduled to send on the first day of the week or month.'=>'Звіти будуть автоматично заплановані для відправки в перший день тижня або місяця.','Request Failed!'=>'Запит не виконано!','Request Payout'=>'Запросити виплату','Require payment details to request payout.'=>'Щоб надіслати запит на виплату, потрібні платіжні реквізити.','Required order status to show on affiliate dashboard:'=>'Обов\'язковий статус замовлення для відображення на інформаційній панелі партнера:','Required?'=>'Необхідний?','Requirement:'=>'Вимога:','Requires cron jobs to be enabled on your site. Make sure to test this is working after activating. We highly recommend using "Real Cron Jobs" instead of WP Cron.'=>'Вимагає, щоб на вашому сайті були активовані cron завдання. Обов\'язково перевірте, чи це працює після активації. Ми настійно рекомендуємо використовувати "Real Cron Jobs" замість WP Cron.','Requires cron jobs to be enabled.'=>'Вимагає включення завдань cron.','Requires cron jobs to be enabled. We recommend using "Real Cron Job" instead of "WP-Cron". This may offer better performance, and will give more accurate delivery (at the specific day & time). <a href="https://couponaffiliates.com/docs/real-cron-job" target="_blank">Click here to learn more</a>.'=>'Вимагає включення завдань cron. Ми рекомендуємо використовувати "Real Cron Job" замість "WP-Cron". Це може забезпечити кращу продуктивність і забезпечить більш точну доставку (в конкретний день і час). <a href="https://couponaffiliates.com/docs/real-cron-job" target="_blank">Натисніть тут, щоб дізнатися більше</a>.','Reverse this payout'=>'Скасувати цю виплату','Reversed'=>'Назад','Reward the affiliate bonus "unpaid commission"'=>'Винагороджуйте партнерський бонус "невиплаченою комісією"','Reward the affiliate user with a free product order'=>'Винагородіть афілійованого користувача безкоштовним замовленням продукту','Reward the affiliate user with a gift coupon'=>'Винагородіть афілійованого користувача подарунковим купоном','Reward the affiliate with store credit'=>'Винагородіть партнера кредитом магазину','Right'=>'Праворуч','Roadmap'=>'Дорожня карта','Role already exists. Please choose a different display name.'=>'Роль вже існує. Будь ласка, виберіть інше відображуване ім\'я.','Rotation:'=>'Обертання:','Rounded (25px)'=>'Округлені (25px)','Run ajax "all time" stats refresh / calculations in batches, to help prevent timeouts or ajax issues.'=>'Запускайте оновлення статистики / обчислення ajax "за весь час" пакетами, щоб запобігти тайм-аутам або проблемам з ajax.','Sales'=>'Продажу','Save & Continue'=>'Зберегти та продовжити','Save Changes'=>'Зберегти зміни','Save changes'=>'Збережіть зміни','Save Settings'=>'Збережіть налаштування','Save the calculated "all time" stats for coupons as meta data.'=>'Збережіть розраховану статистику за весь час для купонів як метадані.','Save the calculated "commission" values as meta data on each individual order.'=>'Зберігайте розраховані значення "комісії" як метадані для кожного окремого замовлення.','Save the conversion rate for each order.'=>'Збережіть коефіцієнт конверсії для кожного замовлення.','Saving Data'=>'Збереження даних','Saving...'=>'Збереження...','Schedule'=>'Розклад','Schedule this creative to only show between certain dates. Useful for seasonal creatives, or limited time promotions. Leave empty to always show.'=>'Заплануйте показ цього креативу лише між певними датами. Корисно для сезонних креативів або обмежених за часом акцій. Залиште порожнім, щоб завжди показувати.','Scheduled Payout Requests'=>'Заплановані запити на виплати','Scheduled Payout Requests:'=>'Заплановані запити на виплати:','Scheduled Requests (Payouts)'=>'Заплановані запити (виплати)','Search Bonus'=>'Пошук бонусу','Search Coupons'=>'Пошук купонів','Search Creatives'=>'Пошукові креативи','Search for a user...'=>'Пошук користувача...','Search our documentation for help with common questions and issues.'=>'Пошукайте в нашій документації, щоб отримати допомогу з поширеними запитаннями та проблемами.','Secret Key'=>'Секретний ключ','Section Layout'=>'Планування розділів','Select a Campaign'=>'Виберіть кампанію','Select a product category to filter the products shown in the table.'=>'Виберіть категорію товарів, щоб відфільтрувати товари, відображені в таблиці.','Select an API Provider:'=>'Виберіть постачальника API:','Select an icon'=>'Виберіть піктограму','Select field label:'=>'Виберіть мітку поля:','Select multiple CUSTOM order statuses that for "unpaid commission" should be granted for. If you only have one, or do not have any custom statuses, turn the "multiple order statuses" option off.'=>'Виберіть кілька статусів CUSTOM замовлень, для яких має бути надано "несплачену комісію". Якщо у вас є лише один або немає користувацьких статусів, вимкніть опцію "кілька статусів замовлень".','Select Payout Methods to Schedule:'=>'Виберіть способи виплат, щоб запланувати:','Select the payout methods that should be scheduled and requested automatically. If an affiliate is using a different payout method to one enabled above, their payouts will not be scheduled.'=>'Виберіть способи виплат, які повинні бути заплановані та запитані автоматично. Якщо партнер використовує інший метод виплат, ніж той, що ввімкнено вище, його виплати не будуть заплановані.','Send a custom new user account email (replaces default registration email).'=>'Надішліть користувацький електронний лист для нового облікового запису користувача (замінює електронну пошту реєстрації за замовчуванням).','Send an email to admin when a new domain is added by affiliate for direct link tracking.'=>'Надішліть електронний лист адміністратору, коли партнер додає новий домен для прямого відстеження посилань.','Send an email to admin when there are 1 or more "scheduled" payout requests (this will be sent instead of multiple individual emails).'=>'Надішліть електронний лист адміністратору, коли надійде 1 або більше «запланованих» запитів на виплату (це буде надіслано замість кількох окремих електронних листів).','Send an email to admin when there is a new affiliate application.'=>'Надішліть електронний лист адміністратору, коли з\'явиться нова партнерська програма.','Send an email to admin when there is a new payout request for unpaid commission.'=>'Надішліть електронний лист адміністратору, коли з\'явиться новий запит на виплату невиплаченої комісії.','Send an email to affiliate users when their domain is accepted for Direct Link Tracking.'=>'Надішліть електронний лист афілійованим користувачам, коли їхній домен буде прийнято для прямого відстеження посилань.','Send an email to affiliate users when their domain is declined for Direct Link Tracking.'=>'Надішліть електронний лист афілійованим користувачам, коли їхній домен відхилено для відстеження прямих посилань.','Send an email to affiliate when their affiliate application is accepted.'=>'Надішліть електронний лист партнеру, коли його заявку на партнерство буде прийнято.','Send an email to affiliate when their affiliate application is declined.'=>'Надішліть електронний лист партнеру, коли його заявку на партнерство буде відхилено.','Send an email to affiliate when they submit the affiliate application form.'=>'Надішліть електронний лист партнеру, коли він надішле форму заявки на партнерство.','Send an email to affiliates if order they referred has been cancelled, refunded, or failed. Only when status was previously "completed".'=>'Надішліть електронний лист афілійованим особам, якщо замовлення, на яке вони посилалися, було скасовано, повернуто гроші або не вдалося. Тільки тоді, коли статус раніше був "завершено".','Send an email to affiliates when a payout request is successfully marked as paid.'=>'Надсилайте електронний лист партнерам, коли запит на виплату успішно позначено як оплачений.','Send an email to affiliates whenever their coupon code is used.'=>'Надсилайте електронний лист партнерам щоразу, коли використовується їхній код купона.','Send an email to parent affiliate when a new affiliate signs up in their MLA network.'=>'Надішліть електронний лист батьківській афілійній особі, коли новий партнер реєструється в їхній мережі MLA.','Send an email to parent affiliate when a sub-affiliate refers a new order (and it is completed).'=>'Надішліть електронний лист материнському партнеру, коли субпартнер надсилає нове замовлення (і воно виконано).','Send an email when parent invite enters an email address to send affiliate program invitation.'=>'Надішліть електронний лист, коли батьківське запрошення введе адресу електронної пошти для надсилання запрошення до партнерської програми.','Send Invite'=>'Надіслати запрошення','Send the user an email'=>'Надішліть користувачу електронний лист','Serif'=>'Із засічками','Set a custom referrer for orders.'=>'Встановіть кастомного реферера для замовлень.','Set a different user role for pending affiliate users.'=>'Встановіть іншу роль користувача для афілійованих користувачів, які очікують на розгляд.','Set a threshold on the maximum amount that can be paid automatically. Any payout requests above this amount will require manual approval.'=>'Встановіть поріг на максимальну суму, яка може бути виплачена автоматично. Будь-які запити на виплати, що перевищують цю суму, потребують схвалення вручну.','Set an expiration date for this reward. Leave empty for no expiration date.'=>'Встановіть дату закінчення терміну дії цієї винагороди. Залиште порожнім без терміну придатності.','Set custom "flexible commission" amounts for each individual coupon, product, category, or user group/role.'=>'Встановлюйте власні суми «гнучкої комісії» для кожного окремого купона, продукту, категорії або групи/ролі користувачів.','Set custom commission per affiliate / coupon.'=>'Встановіть спеціальну комісію за афіліату / купон.','Set custom commission per product.'=>'Встановіть спеціальну комісію за кожен продукт.','Set custom commission settings for this group.'=>'Встановіть власні налаштування комісії для цієї групи.','Set new commission rates for the affiliate coupon'=>'Встановіть нові ставки комісії для партнерського купона','Set the affiliate invite URL variable that will be used in your site URL to identify the referrer and parent affiliate for that user.'=>'Встановіть змінну URL-адреси запрошення до афілійованої особи, яка використовуватиметься в URL-адресі вашого сайту для ідентифікації реферера та батьківської афілійованої особи для цього користувача.','Set the custom commission rates for each user role below (this is the role of the affiliate user). Leave empty to use default rates.'=>'Встановіть спеціальні ставки комісійних для кожної ролі користувача нижче (це роль афілійованого користувача). Залиште порожнім, щоб використовувати ставки за замовчуванням.','Set the primary referral coupon for this order. This will override all other settings, as the default and only coupon that will earn commission from this order.'=>'Встановіть основний реферальний купон для цього замовлення. Це замінить усі інші налаштування, як стандартний і єдиний купон, який отримуватиме комісію з цього замовлення.','Set the referral URL variable that will be used in your site URL to identify the referrer and to automatically apply that coupon, and track clicks.'=>'Встановіть змінну URL-адреси переходу, яка використовуватиметься в URL-адресі вашого сайту для ідентифікації перенаправлення та автоматичного застосування цього купона, а також відстеження кліків.','Set the referral URL variable that will be used to identify the campaign.'=>'Встановіть змінну URL-адреси переходу, яка буде використовуватися для ідентифікації кампанії.','Set to "0" for permanent lifetime commission with no expiry time.'=>'Встановлено на "0" для постійної довічної комісії без терміну дії.','Set Your Commission Rates'=>'Встановлюйте свої комісійні ставки','SETTINGS'=>'ПАРАМЕТРИ','Settings'=>'Параметри','Settings & Customization'=>'Налаштування та налаштування','Settings not saving automatically?'=>'Налаштування не зберігаються автоматично?','Settings not saving? Try disabling "legacy" saving, or increasing your PHP "max_input_vars" in your hosting configuration to 1000 or higher (currently %s).'=>'Налаштування не зберігаються? Спробуйте відключити "застаріле" збереження або збільшити "max_input_vars" PHP у конфігурації хостингу до 1000 або вище (зараз %s).','settings page'=>'Сторінка налаштувань','Settings Saved'=>'Налаштування збережено','Settings updated successfully.'=>'Налаштування успішно оновлено.','Setup'=>'Установки','Setup a CAPTCHA on your affiliate registration form to help prevent spam.'=>'Налаштуйте CAPTCHA у формі реєстрації партнера, щоб запобігти спаму.','Setup Guide'=>'Керівництво по налаштуванню','Setup Guide – How to get started!'=>'Посібник із налаштування – Як почати!','Setup Wizard'=>'Майстер налаштування','Setup Wizard Complete!'=>'Майстер налаштування завершено!','Shipping'=>'Доставка','Short URL'=>'Коротка URL-адреса','Short URL Generator (Referral URL)'=>'Генератор коротких URL (реферальна URL-адреса)','Short URLs'=>'Короткі URL-адреси','Shortcodes'=>'Шорткоди','Shortlink Slug'=>'Шортлінк Слимак','Shortlinks are stored as a custom post type and can be viewed in "Short URLs" menu link under "Coupon Affiliates" in the admin area (vi