ування / Перейти на сторінку налаштувань','Small (8px)'=>'Малий (8px)','So for example, if order amount is $100 and the main affiliate rate is 50%, then the main affiliate earns $50. If the tier 1 commission is set to 10%, the tier 1 commission would be $5.'=>'Так, наприклад, якщо сума ордера становить $100, а основна партнерська ставка становить 50%, то основний партнер заробляє $50. Якщо комісія рівня 1 встановлена на рівні 10%, комісія рівня 1 становитиме 5 доларів США.','So for example, if the total order amount is $100, and the tier 1 commission is set to 10%, the tier commission would be $10.'=>'Так, наприклад, якщо загальна сума замовлення становить 100 доларів США, а комісія рівня 1 встановлена на рівні 10%, комісія рівня становитиме 10 доларів США.','Social Sharing (Referral URL)'=>'Публікація в соціальних мережах (URL-адреса переходу)','Social Sharing Buttons'=>'Кнопки для публікації в соціальних мережах','Sorry, only new customers can use this coupon code.'=>'На жаль, лише нові клієнти можуть використовувати цей код купона.','Sorry, this coupon is not assigned to you.'=>'На жаль, цей купон вам не призначений.','Sorry, this coupon is not assigned to you. You can only edit your own account details.'=>'На жаль, цей купон вам не призначений. Ви можете редагувати лише дані власного облікового запису.','Sorry, this domain is already being used.'=>'На жаль, цей домен вже використовується.','Sorry, this domain is invalid. Please try again.'=>'На жаль, цей домен недійсний. Будь ласка, спробуйте ще раз.','Sorry, this domain is not allowed.'=>'На жаль, цей домен не дозволений.','Sorry, this is not your coupon affiliate dashboard.'=>'Вибачте, це не ваша партнерська інформаційна панель купонів.','Sorry, this is not your coupon. Only the user assigned to this coupon can update the payment details for this coupon.'=>'Вибачте, це не ваш купон. Тільки користувач, якому призначено цей купон, може оновити платіжні реквізити для цього купона.','Sorry, this statement is not linked to your account.'=>'На жаль, ця заява не пов\'язана з вашим обліковим записом.','Sorry, you are not currently allowed to apply as an affiliate.'=>'На жаль, наразі ви не маєте права подавати заявку як партнер.','Sorry, you can only use one affiliate coupon per order.'=>'На жаль, ви можете використовувати лише один партнерський купон на замовлення.','Sorry, you can\'t use this coupon code or it has expired.'=>'На жаль, ви не можете використати цей код купона або термін його дії минув.','Sorry, you can\'t use your own affiliate coupon code.'=>'На жаль, ви не можете використовувати власний код купона партнера.','Sorry, you do not have permission to view the MLA dashboard for user:'=>'На жаль, у вас немає дозволу на перегляд інформаційної панелі MLA для користувача:','Sorry, you do not have permission to view the MLA dashboard.'=>'На жаль, у вас немає дозволу на перегляд приладної дошки MLA.','Sorry, you don\'t currently have any active affiliate coupons.'=>'На жаль, наразі у вас немає активних партнерських купонів.','Specific User ID:'=>'Конкретний ідентифікатор користувача:','Spend Limits'=>'Ліміти витрат','Square (0px)'=>'Квадрат (0px)','Start'=>'Почати','Start Date:'=>'Дата початку:','Start typing username here...'=>'Почніть вводити ім\'я користувача тут...','Start your FREE 7 Day Trial'=>'Почніть свій БЕЗКОШТОВНИЙ 7-денний пробний період','Statement'=>'Заява','Statement Details'=>'Деталі заяви','Statement Footer Image (Logo/Signature)'=>'Зображення нижнього колонтитула заяви (логотип/підпис)','Statement Footer Text'=>'Текст нижнього колонтитула висловлювання','Statement Header Image (Logo)'=>'Зображення заголовка заяви (логотип)','Statement Settings'=>'Налаштування виписки','Statements'=>'Заяви','Statistics'=>'Статистика','Statistics Text Alignment'=>'Статистика вирівнювання тексту','Status'=>'Статус','Statuses'=>'Статуси','Stop "unpaid commission" from being earned for non-affiliate coupons.'=>'Зупиніть отримання «невиплаченої комісії» за купони, не пов\'язані з партнерами.','Store cookie for how many days?'=>'Скільки днів зберігати печиво?','Store cookies for domain link tracking and blacklists.'=>'Зберігайте файли cookie для відстеження доменних посилань і чорних списків.','Store cookies for MLA referral links (recommended).'=>'Зберігайте файли cookie для реферальних посилань MLA (рекомендовано).','Store cookies for referral links (recommended).'=>'Зберігайте файли cookie для реферальних посилань (рекомендується).','Store Credit'=>'Кредит на магазин','Store Credit / Wallet'=>'Кредит / гаманець магазину','Store Credit Balance'=>'Зберігати кредитний баланс','Store Credit Discount'=>'Знижка на кредит магазину','Store Credit Payouts'=>'Кредитні виплати в магазині','Store credit payouts will allow affiliates to have commission paid out into a "wallet" which they can then use as a discount to purchase items/products from your shop.'=>'Виплати кредитів у магазині дозволять афілійованим особам виплачувати комісію на «гаманець», який вони потім можуть використовувати як знижку для покупки товарів/продуктів у вашому магазині.','store credit was removed from user'=>'Кредит магазину було видалено з користувача','store credit was successfully paid to user'=>'Кредит магазину був успішно виплачений користувачеві','Store visitors "IP Address" for referral clicks, instead of a random ID.'=>'Зберігайте відвідувачам «IP-адресу» для переходів за посиланнями, а не випадковий ID.','Strict Fraud Prevention'=>'Суворе запобігання шахрайству','Stripe'=>'Смугою','Stripe Account Label'=>'Мітка облікового запису Stripe','Stripe Connect Account'=>'Обліковий запис Stripe Connect','Stripe Connect Account (TEST MODE)'=>'Обліковий запис Stripe Connect (ТЕСТОВИЙ РЕЖИМ)','Stripe Connect Account Type'=>'Тип облікового запису Stripe Connect','Stripe Connect Account Type (TEST MODE)'=>'Тип облікового запису Stripe Connect (ТЕСТОВИЙ РЕЖИМ)','Stripe Payouts'=>'Виплати Stripe','Stripe Payouts ("Connect")'=>'Виплати Stripe («Підключення»)','Stripe Payouts payment method will allow you to one-click pay your affiliates directly into their Stripe / bank account.'=>'Спосіб оплати Stripe Payouts дозволить вам в один клік платити своїм партнерам безпосередньо на їхній Stripe / банківський рахунок.','Style #1 - Basic (Legacy)'=>'Стиль #1 - Базовий (Legacy)','Style #1 - Default'=>'Стиль #1 - за замовчуванням','Style #2 - Full Width (Modern)'=>'Стиль #2 - повна ширина (сучасний)','Style #2 - Modern (Bold)'=>'Стиль #2 - Модерн (Сміливий)','Style #3 - Modern (Compact)'=>'Стиль #3 - Сучасний (компактний)','Style:'=>'Стиль:','Sub-affiliate summary'=>'Підсумки роботи суб-партнерів','Sub-Affiliates'=>'Суб-партнери','Submit a feature request.'=>'Надішліть запит на функцію.','Submit Application'=>'Відправити заявку','Submit Payout Requests'=>'Надсилайте запити на виплати','Subscription Renewal Order'=>'Замовлення на продовження підписки','Subscription Renewal Settings'=>'Налаштування поновлення підписки','Subscriptions'=>'Підписки','Subscriptions (Recurring Referrals)'=>'Підписки (повторювані реферали)','Subtotal'=>'Проміжні підсумки','Success'=>'Успіх','Success! Redirecting'=>'Успіх! Перенаправлення','Summary'=>'Зведення','Support Ticket'=>'Заявка в службу підтримки','Supported merge tags'=>'Підтримувані теги злиття','Tab Colours'=>'Кольори вкладок','Tab Icon:'=>'Піктограма вкладки:','Table Header & Footer'=>'Верхній і нижній колонтитули таблиці','Tabs'=>'Вкладки','Tabs Border Radius'=>'Радіус облямівки вкладок','Tabs Font Size'=>'Розмір шрифту вкладок','Tabs Hover'=>'Наведення курсору на вкладки','Tabs Size / Padding'=>'Розмір вкладок / Відступи','Tabs Style'=>'Стиль вкладок','Tax'=>'Податок','Tax Number'=>'Податковий номер','Tax Rate'=>'Ставка податку','Tax Settings'=>'Налаштування податків','Tax/VAT Calculations'=>'Розрахунки податку/ПДВ','Tax/VAT Number'=>'Податковий/ПДВ номер','Taxes'=>'Податки','Template'=>'Шаблон','Template Coupon'=>'Шаблон купона','Template Coupon Code'=>'Шаблон Код купона','Template coupon code:'=>'Шаблон коду купона:','Template Coupons'=>'Шаблон купонів','Template coupons this user role is assigned to:'=>'Шаблонні купони ця роль користувача призначена:','Template Gift Coupon Code:'=>'Шаблон коду подарункового купона:','Terms & Conditions Generator'=>'Генератор правил та умов','Terms and Conditions Acceptance Checkbox'=>'Пункт «Чекбокс про прийняття положень та умов»','Terms and Conditions Page'=>'Сторінка з правилами та умовами','Terms and Conditions Page Generator'=>'Генератор сторінок з правилами та умовами','Text'=>'Текст','Text Area Field'=>'Поле області тексту','Text Field'=>'Текстове поле','Text shown next to the users store credit balance.'=>'Текст відображається поруч із залишком кредиту магазину користувача.','Text:'=>'Текст:','than'=>'ніж','The "%s" coupon already exists. Please try again with a different coupon code.'=>'Купон "%s" вже існує. Будь ласка, спробуйте ще раз з іншим кодом купона.','The "Affiliate Portal" is an alternative to the normal "affiliate dashboard" page.'=>'«Партнерський портал» є альтернативою звичайній сторінці «Інформаційна панель партнера».','The "Store Credit" payout method needs to be enabled to use this reward.'=>'Щоб використовувати цю винагороду, потрібно ввімкнути метод виплати "Кредит на зберігання".','The "template coupon" you have set does not exist. Please make sure you have created it, and entered the exact name in the settings.'=>'Встановленого вами "шаблонного купона" не існує. Будь ласка, переконайтеся, що ви його створили, і ввели точну назву в налаштуваннях.','The "unpaid commission" meets the required payment threshold.'=>'«Несплачена комісія» відповідає необхідному порогу платежу.','The affiliate can then download these statements on the affiliate dashboard, and you can also download them in the admin payouts section.'=>'Потім партнер може завантажити ці заяви на інформаційній панелі партнера, а ви також можете завантажити їх у розділі виплат адміністратора.','The affiliate can then request a payout for this commission in their affiliate dashboard, which will notify you. This can then be paid in the admin "Payouts" page.'=>'Потім партнер може запросити виплату цієї комісії на своїй партнерській інформаційній панелі, про що ви отримаєте сповіщення. Потім це можна сплатити на сторінці "Виплати" адміністратора.','The affiliate dashboard for this coupon needs to be loaded at-least once.'=>'Інформаційна панель партнера для цього купона має бути завантажена принаймні один раз.','The affiliate portal is enabled, but the URL rewrite rules are not work correctly.'=>'Партнерський портал увімкнено, але правила перезапису URL працюють некоректно.','The affiliate user %s has been successfully added.'=>'Афілійований користувач %s був успішно доданий.','The affiliate user can then visit the "affiliate dashboard page" to view their affiliate statistics, commissions, referral URLs, etc, for the coupon(s) they are assigned to.'=>'Потім партнерський користувач може відвідати «сторінку інформаційної панелі партнера», щоб переглянути статистику своїх партнерів, комісійні, реферальні URL-адреси тощо для купонів, яким вони призначені.','The affiliate user can then visit the "affiliate dashboard page" to view their affiliate statistics, commissions, referral URLs, etc, for the coupons they are assigned to.'=>'Потім партнерський користувач може відвідати «сторінку інформаційної панелі партнера», щоб переглянути статистику своїх партнерів, комісійні, реферальні URL-адреси тощо для купонів, яким вони призначені.','The affiliate user has been successfully added.'=>'Афілійований користувач успішно доданий.','The affiliate user has entered their payment details (in the "settings" tab on their dashboard).'=>'Партнерський користувач ввів свої платіжні дані (у вкладці «налаштування» на інформаційній панелі).','The affiliate user has not yet been set for this coupon.'=>'Партнерський користувач ще не налаштований на цей купон.','The affiliate user has not yet set their payout details on the affiliate dashboard.'=>'Партнерський користувач ще не встановив свої дані про виплати на інформаційній панелі партнера.','The below section includes a list of most of the modules and features included in the Pro plan. However other smaller features and customisations can be found throughout the settings page.'=>'Наведений нижче розділ містить список більшості модулів і функцій, що входять до плану Pro. Однак інші менші функції та налаштування можна знайти на сторінці налаштувань.','The below table will show all affiliate coupons where the "unpaid commission" amount is more than'=>'У наведеній нижче таблиці будуть показані всі партнерські купони, де сума «невиплаченої комісії» перевищує','The commission for is calculated based on a fixed amount earned by each tier per order referred by a sub-affiliate.'=>'Комісія за розраховується на основі фіксованої суми, заробленої кожним рівнем за замовлення, рекомендоване субпартнером.','The commission for is calculated based on a percentage of the total order amount.'=>'Комісія за розраховується виходячи з відсотка від загальної суми замовлення.','The commission is calculated based on a percentage of the amount earned by the main affiliate.'=>'Комісія розраховується на основі відсотка від суми, заробленої основним партнером.','The coupon code you entered does not exist.'=>'Введеного вами коду купона не існує.','The coupon has an affiliate user assigned to it.'=>'За купоном закріплений афілійований користувач.','The creative will only be visible to affiliates with any of the selected user roles.'=>'Креатив буде видно лише афіліатам із будь-якою з вибраних ролей користувача.','The default "Page URL" when affiliates generate referral links in the dashboard. Note: This needs to be a valid link/page on this website only.'=>'За замовчуванням "URL сторінки", коли партнери генерують реферальні посилання на інформаційній панелі. Примітка: Це має бути дійсне посилання/сторінка лише на цьому веб-сайті.','The email address of the affiliate.'=>'Адреса електронної пошти партнера.','The email report will use the same email template/styling from the WooCommerce email settings.'=>'У звіті по електронній пошті буде використовуватися той же шаблон/стиль листа з налаштувань WooCommerce.','The first name of the affiliate.'=>'Ім\'я філії.','The following integration addons are available to download and install right now:'=>'Наразі для завантаження та встановлення доступні такі додатки для інтеграції:','The free version gives access to admin reports for the past 4 weeks. Reports allow you to see the overall statistics for all affiliates/coupons, and each individual affiliate/coupon, on a single page'=>'Безкоштовна версія дає доступ до звітів адміністратора за останні 4 тижні. Звіти дозволяють побачити загальну статистику по всіх партнерам/купонам і кожному окремому партнеру/купону на одній сторінці','The gift coupon code that was generated.'=>'Згенерований код подарункового купона.','The header text displayed at the top of the tab content.'=>'Текст заголовка відображається у верхній частині вмісту вкладки.','The IP address will be stored in the "clicks" database table. The IP address is only used to check if a click has already been tracked for that visitor.'=>'IP-адреса буде зберігатися в таблиці бази даних "clicks". IP-адреса використовується лише для перевірки того, чи вже було відстежено клік для цього відвідувача.','The last name of the affiliate.'=>'Прізвище, ім\'я та по батькові філії.','The maximum amount of extra tiers in your MLA system (not including the main affiliate).'=>'Максимальна кількість додаткових рівнів у вашій системі MLA (без урахування основного партнера).','The maximum date range is 12 months. Your filters have been updated.'=>'Максимальний діапазон дат – 12 місяців. Ваші фільтри оновлено.','The maximum number of orders to show when filtered by date. Too many could make it take significantly longer to load.'=>'Максимальна кількість замовлень для відображення при фільтруванні за датою. Занадто велика кількість може призвести до того, що завантаження займе значно більше часу.','The name of the tab button.'=>'Назва кнопки вкладки.','The name of your Store Credit wallet, show in the payout method selection etc.'=>'Назва вашого гаманця Store Credit, відображається у виборі способу виплати тощо.','The next scheduled payout requests will be on'=>'Наступні заплановані запити на виплати будуть на','The number of days after an order is created, that the commission earned is added to the users account as "unpaid commission. Useful if you want to prevent commission being paid out early for orders that may be refunded etc.'=>'Кількість днів після створення замовлення, протягом яких зароблена комісія додається в обліковий запис користувача як «несплачена комісія». Корисно, якщо ви хочете запобігти достроковій виплаті комісії за замовлення, які можуть бути повернуті тощо.','The order status required for "unpaid commission" to be granted. Default "completed" for most sites. This should be the final status for your orders, once it has been paid and delivered.'=>'Статус замовлення, необхідний для надання "невиплаченої комісії". За замовчуванням "завершено" для більшості сайтів. Це має бути остаточний статус для ваших замовлень, після того, як вони були оплачені та доставлені.','The page is built with the default "Gutenberg" page builder, and will include important information about your affiliate program like commission rates, along with the registration form for users to sign up for your affiliate program. You can also set this page as the default registration page.'=>'Сторінка створена за допомогою конструктора сторінок "Gutenberg" за замовчуванням і міститиме важливу інформацію про вашу партнерську програму, як-от ставки комісійних, а також форму реєстрації для користувачів, щоб зареєструватися у вашій партнерській програмі. Ви також можете встановити цю сторінку як сторінку реєстрації за замовчуванням.','The passwords do not match. Please try again.'=>'Паролі не співпадають. Будь ласка, спробуйте ще раз.','The plugin will default to the normal dashboard page until the rewrite rule exists.'=>'Плагін за замовчуванням працюватиме на звичайній сторінці інформаційної панелі, доки не буде існувати правило перезапису.','The PRO version of this plugin includes a terms and conditions page generator, which allows you to easily create your own terms and conditions page.'=>'PRO-версія цього плагіна включає генератор сторінок з умовами та положеннями, який дозволяє легко створити власну сторінку з умовами та положеннями.','The registration page is currently set to:'=>'На поточній сторінці реєстрації встановлено:','The stats/content isn’t loading on my dashboard. How can I fix this?'=>'Статистика/контент не завантажується на моїй інформаційній панелі. Як це виправити?','The tab will only be visible to affiliates with any of the selected user roles.'=>'Вкладку зможуть бачити лише афіліати з будь-якою з обраних ролей користувачів.','The table shows up to 20 products per page by default, with pagination, and a search field.'=>'У таблиці за замовчуванням відображається до 20 товарів на сторінці, з нумерацією сторінок і полем пошуку.','The tax rate that will be added to the payment statements.'=>'Ставка податку, яка буде додана до виписки про оплату.','The total commission you have earned from this specific sub-affiliate referrals.'=>'Загальна комісія, яку ви заробили від цих конкретних рефералів суб-партнерів.','The unpaid commission amount is below the payout threshold.'=>'Несплачена сума комісії нижча за поріг виплати.','The user role will be generated automatically as: coupon_affiliate_[display_name]'=>'Роль користувача буде згенерована автоматично так: coupon_affiliate_[display_name]','The user will be notified by email, and can then login to their affiliate dashboard to view their statistics and more.'=>'Користувач отримає сповіщення електронною поштою, а потім зможе увійти на інформаційну панель свого партнера, щоб переглянути свою статистику та багато іншого.','The username of the affiliate.'=>'Ім\'я користувача партнера.','The username will be used as the coupon code by default, unless you have the "Dynamic Code Generator" enabled.'=>'Ім\'я користувача буде використовуватися як код купона за замовчуванням, якщо у вас не ввімкнено «Генератор динамічного коду».','Then, only users that are assigned to a coupon will be able to see their dashboard (for that coupon) on this page.'=>'Тоді лише користувачі, яким призначено купон, зможуть бачити свою інформаційну панель (для цього купона) на цій сторінці.','There are also a variety of options available below to automate payout requests/payments, select your payout methods, and much more!'=>'Нижче також доступні різноманітні опції для автоматизації запитів/платежів на виплати, вибору методів виплати та багато іншого!','There are several other ways payout requests can be submitted, for the affiliates available "unpaid commission".'=>'Є кілька інших способів подання запитів на виплати, для партнерів доступна «невиплачена комісія».','There have been no clicks for this campaign yet.'=>'Кліків за цією кампанією ще не було.','There was an error connecting to Stripe account. Please contact an administrator.'=>'Сталася помилка при підключенні до облікового запису Stripe. Будь ласка, зверніться до адміністратора.','These are line graphs that show the commission earnings for every day in the past 90 days, 30 days or 7 days.'=>'Це лінійні графіки, які показують заробіток комісії за кожен день за останні 90 днів, 30 днів або 7 днів.','These details will be shown on your PDF statements for payouts.'=>'Ці дані будуть відображені у ваших виписках у форматі PDF для виплат.','These options will improve loading speed of your affiliate dashboard for large coupons with lots of orders (since it wont need to calculate every time).'=>'Ці опції покращать швидкість завантаження вашої партнерської панелі для великих купонів з великою кількістю замовлень (оскільки її не потрібно буде розраховувати щоразу).','These settings allow you to restrict the bonus to only be available for specific users.'=>'Ці налаштування дозволяють обмежити бонус, щоб він був доступний лише для конкретних користувачів.','These settings let you customise the format of the referral links that your affiliates can generate on their affiliate dashboard.'=>'Ці налаштування дозволяють налаштувати формат реферальних посилань, які ваші партнери можуть генерувати на своїй партнерській панелі.','These values be overridden on a per coupon and/or per product basis.'=>'Ці значення мають бути перевизначені на основі купона та/або окремого продукту.','These visitors will not be able to use any affiliate coupons on their purchases, and can not apply to become an affiliate.'=>'Ці відвідувачі не зможуть використовувати будь-які партнерські купони на свої покупки та не можуть подати заявку на отримання статусу партнера.','These will take priority over the global commission rate settings, however if you set per-coupon or per-product commission rates too, those will take priority instead.'=>'Вони матимуть пріоритет над глобальними налаштуваннями комісійних ставок, однак, якщо ви встановите також ставки комісії за купон або за продукт, вони матимуть пріоритет.','They would need to click the referral link again for coupons to be automatically applied again, or future orders to be awarded to the affiliate.'=>'Їм потрібно буде знову натиснути на реферальне посилання, щоб купони були автоматично застосовані знову або майбутні замовлення були присуджені партнеру.','This affiliate (%s) is a part of your MLA network. You are viewing their statistics and commission earnings.'=>'Цей партнер (%s) є частиною вашої мережі MLA. Ви переглядаєте їх статистику і комісійні заробітки.','This allows you to set the maximum commission amount that is calculated and can be earned per order referred by affiliates.'=>'Це дозволяє встановити максимальну суму комісії, яка розраховується і може бути отримана за замовлення, направлене афіліатами.','This bonus is not applied on the dashboard or when they request payouts. It will simply apply the bonus % as additional credit, when the payout is marked as paid.'=>'Цей бонус не застосовується на інформаційній панелі або під час запиту виплат. Він просто зарахує бонусний % як додатковий кредит, коли виплата буде позначена як виплачена.','This bonus was granted as an initial award for becoming a new affiliate.'=>'Цей бонус був наданий як початкова нагорода для того, щоб стати новим партнером.','This can not be edited for a lifetime affiliate referral.'=>'Це не може бути відредаговано для довічного реферала афіліата.','This can not be edited when the order is completed.'=>'Це не може бути відредаговано після виконання замовлення.','This coupon does not exist!'=>'Цього купона не існує!','This email already exists. Please try again, or login first.'=>'Ця електронна пошта вже існує. Будь ласка, спробуйте ще раз або спочатку увійдіть.','This email has already been invited.'=>'Цей лист вже був запрошений.','This excludes the plugin settings which are available to those with the "manage_options" permission.'=>'Це без урахування налаштувань плагіна, які доступні для тих, хто має дозвіл на manage_options.','This feature allows you to collect the conversion rates automatically from an Exchange Rates API.'=>'Ця функція дозволяє автоматично збирати курси конвертації за допомогою API обмінних курсів.','This feature is disabled because you have disabled the cookie storage.'=>'Ця функція вимкнена, оскільки ви вимкнули зберігання файлів cookie.','This includes a nice email report, along with a downloadable PDF version attached to the email.'=>'Це включає гарний звіт електронною поштою, а також версію у форматі PDF, яку можна завантажити, прикріплену до електронного листа.','This is how many days after someone clicks on a referral link, that the cookie will be stored to automatically apply the coupon.'=>'Це стільки днів після того, як хтось натисне на реферальне посилання, файл cookie буде збережено для автоматичного застосування купона.','This is limited to PDF files only. These invoices will be uploaded to a "coupon-affiliate-invoices" folder in your uploads directory.'=>'Це стосується лише PDF-файлів. Ці рахунки-фактури будуть завантажені в папку "coupon-affiliate-invoices" у вашому каталозі завантажень.','This is only a basic spam protection method, and is not as effective as CAPTCHA.'=>'Це лише базовий метод захисту від спаму, і він не такий ефективний, як CAPTCHA.','This is our default store credit system, built directly into this plugin. (A more simple solution with no additional setup needed.)'=>'Це наша система кредитування магазину за замовчуванням, вбудована безпосередньо в цей плагін. (Більш просте рішення без необхідності додаткового налаштування.)','This is required for domain link tracking and domain blacklists to work.'=>'Це потрібно для роботи відстеження доменних посилань і чорних списків доменів.','This is set to your home page by default, but can be any page on your website.'=>'За замовчуванням це встановлена на домашній сторінці, але може бути будь-якою сторінкою на вашому веб-сайті.','This is shown at the bottom of the PDF statements, just before the Footer Text. Recommended size is no larger than 340 x 70'=>'Це відображається внизу інструкцій PDF, безпосередньо перед текстом нижнього колонтитула. Рекомендований розмір не більше 340 х 70','This is shown at the very top left of the affiliate portal. Recommended size is 200px width.'=>'Це показано в самому верхньому лівому куті партнерського порталу. Рекомендований розмір – 200px ширина.','This is shown at the very top of the PDF report (attached to the email). Recommended size is 340 x 70.'=>'Це відображається у верхній частині звіту у форматі PDF (прикріпленого до електронного листа). Рекомендований розмір 340 х 70.','This is shown at the very top of the PDF statements. Recommended size is 340 x 70'=>'Це показано у верхній частині виписок PDF. Рекомендований розмір 340 х 70','This is shown below the message above, next to a checkbox, allowing them to apply some or all of their credit to the cart.'=>'Це показано під повідомленням вище, поруч із прапорцем, що дозволяє їм застосувати частину або весь свій кредит до кошика.','This is the amount of bonus commission (flat amount) they will be given from this reward.'=>'Це сума бонусної комісії (фіксована сума), яку вони отримають з цієї винагороди.','This is the amount of days that will be calculated at a time. If you experience issues with the ajax loading, try lowering this number (will be slower but more reliable).'=>'Це кількість днів, яка буде розрахована за один раз. Якщо у вас виникли проблеми із завантаженням ajax, спробуйте знизити це число (буде повільніше, але надійніше).','This is the amount of store credit they will be given from this reward. Funds are added directly to their store credit wallet.'=>'Це сума кредиту магазину, яку вони отримають з цієї винагороди. Кошти надходять безпосередньо на кредитний гаманець магазину.','This is the amount their earned commission from orders will be increased by. For example, 5% would increase $100 commission to $105. This will override any existing reward bonus set.'=>'Саме на таку суму буде збільшена їхня зароблена комісія за замовлення. Наприклад, 5% збільшить комісію в $100 до $105. Це замінить будь-який існуючий набір бонусів за винагороду.','This is the base currency for your store, in which totals/commission will be converted to. You can change this in the WooCommerce settings.'=>'Це базова валюта для вашого магазину, в яку будуть конвертуватися підсумки/комісія. Ви можете змінити це в налаштуваннях WooCommerce.','This is the default referral link your affiliates can share.'=>'Це реферальне посилання за замовчуванням, яким можуть поділитися ваші партнери.','This is the description that will be shown under the progress bar. By default, it shows a summary of the requirement for the reward.'=>'Це опис, який буде показаний під індикатором прогресу. За замовчуванням він показує підсумок вимоги до винагороди.','This is the email address that will recieve admin notifications such as new affiliate registrations, and payout notifications.'=>'Це адреса електронної пошти, на яку надходитимуть сповіщення від адміністратора, такі як реєстрація нових партнерів і сповіщення про виплати.','This is the frequency that the reward can be triggered. For example, if you select "Once Per Month", the reward can only be earned once within a month. In the next month, they can earn the reward again on their next order if they meet the requirements. This refers to the current week/month/year, for example %s or %s.'=>'Це частота, з якою може спрацьовувати винагорода. Наприклад, якщо ви виберете «Один раз на місяць», винагороду можна буде отримати лише один раз протягом місяця. Протягом наступного місяця вони можуть знову отримати винагороду за своє наступне замовлення, якщо вони відповідають вимогам. Це стосується поточного тижня/місяця/року, наприклад %s або %s.','This is the limit on how many renewal orders will be rewarded to the affiliate after the initial signup. This does not include the initial order. Set to 0 for unlimited renewals.'=>'Це обмеження на те, скільки замовлень на продовження буде виплачено партнеру після початкової реєстрації. Сюди не входить початкове замовлення. Встановіть значення 0 для необмеженої кількості продовжень.','This is the message shown on the page as soon as the user submits the application form. The {couponcode} placeholder will be replaced with their chosen coupon code.'=>'Це повідомлення відображається на сторінці, як тільки користувач надсилає форму заявки. Заповнювач {couponcode} буде замінено на вибраний код купона.','This is the name of the discount shown on the cart page, when store credit is applied.'=>'Це назва знижки, яка відображається на сторінці кошика під час використання кредиту магазину.','This is the new commission percentage that will be set for the affiliates coupon.'=>'Це новий відсоток комісії, який буде встановлено для купона для партнерів.','This is the new fixed commission amount per order, that will be set for the coupon.'=>'Це нова фіксована сума комісії за замовлення, яка буде встановлена для купона.','This is the new fixed commission amount per product, that will be set for the coupon.'=>'Це нова фіксована сума комісії за товар, яка буде встановлена для купона.','This is the order status that will be assigned to the new order.'=>'Це статус замовлення, який буде присвоєно новому замовленню.','This is the product ID of the product that will be added to the new order. You can find the product ID by going to the Products page and hovering over the product name.'=>'Це ID товару, який буде додано до нового замовлення. Ідентифікатор товару можна знайти, перейшовши на сторінку Товари та навівши курсор на назву товару.','This is the slug for the shortlinks, for example:'=>'Це slug для шортлінків, наприклад:','This is the user permission required to have full access for this plugin. Administrator will always have access to everything.'=>'Це дозвіл користувача, який потрібен для отримання повного доступу до цього плагіна. Адміністратор завжди матиме доступ до всього.','This link will take you to the affiliate dashboard for this specific coupon.'=>'Це посилання приведе вас на інформаційну панель партнера для цього конкретного купона.','This may be made available in the free version soon. For now, if you need help with creating your terms and conditions page in the free version, you can view <a href="%s" target="_blank">this article</a>.'=>'Незабаром це може стати доступним у безкоштовній версії. Наразі, якщо вам потрібна допомога зі створенням сторінки з правилами та умовами в безкоштовній версії, ви можете переглянути <a href="%s" target="_blank">цю статтю</a>.','This may take a few seconds...'=>'Це може зайняти кілька секунд...','This may therefore disregard some of the order statuses that are checked above.'=>'Тому це може ігнорувати деякі статуси замовлень, які перевірено вище.','This means that you will need to manually edit existing users to the "coupon affiliate", or have them automatically assign to this role when filling out the registration form (enable this in "registration settings").'=>'Це означає, що вам потрібно буде вручну відредагувати існуючих користувачів у "партнерському купоні", або зробити так, щоб вони автоматично призначалися на цю роль при заповненні реєстраційної форми (увімкніть це в "налаштуваннях реєстрації").','This Month'=>'Цього місяця','This option will allow you to enable "lifetime commission" either globally, or on a per-coupon basis.'=>'Ця опція дозволить вам увімкнути «довічну комісію» або глобально, або на основі кожного купона.','This option will enable the "affiliate landing page" metabox on pages, for you to assign a page as a landing page for an affiliate coupon.'=>'Ця опція включить метабокс «партнерська цільова сторінка» на сторінках, щоб ви могли призначити сторінку як цільову сторінку для партнерського купона.','This page displays all the users that are assigned to an affiliate coupon.'=>'На цій сторінці відображаються всі користувачі, яким призначено партнерський купон.','This page is not currently set as the Registration Page.'=>'Ця сторінка в даний час не встановлена як сторінка реєстрації.','This page will then act the same as a referral URL for that affiliate coupon.'=>'Тоді ця сторінка діятиме так само, як реферальна URL-адреса для цього партнерського купона.','This plugin is frequently updated and maintained. If you notice any bugs, issues, or conflicts with other themes/plugins, please get in touch and it will be looked into.'=>'Цей плагін часто оновлюється та підтримується. Якщо ви помітите будь-які помилки, проблеми або конфлікти з іншими темами/плагінами, будь ласка, зв\'яжіться з нами, і це буде розглянуто.','This setting is required in case you have set custom commission amounts on both a coupon level, and product level.'=>'Цей параметр необхідний, якщо ви встановили спеціальні суми комісійних як на рівні купона, так і на рівні продукту.','This tab will show a table listing all your products, along with commission rates they will earn from each individual product.'=>'На цій вкладці з\'явиться таблиця з переліком усіх ваших продуктів, а також ставками комісійних, які вони отримуватимуть за кожен окремий продукт.','This tool help you create a simple but effective custom signup promo page for your affiliate program.'=>'Цей інструмент допоможе вам створити просту, але ефективну промо-сторінку з користувацькою реєстрацією для вашої партнерської програми.','This tool requires Gutenberg to be enabled. Please disable the "Disable Gutenberg" plugin or any other plugin that disables Gutenberg.'=>'Для використання цього інструменту потрібен Gutenberg. Будь ласка, вимкніть плагін «Вимкнути Gutenberg» або будь-який інший плагін, який вимикає Gutenberg.','This tool requires WordPress 5.0 or higher with Gutenberg support.'=>'Для цього інструменту потрібен WordPress 5.0 або вище з підтримкою Gutenberg.','This user does not exist, please enter a valid user, or enter an email address to create a new account.'=>'Цього користувача не існує, будь ласка, введіть дійсного користувача або введіть адресу електронної пошти, щоб створити новий обліковий запис.','This username already exists. Please try again, or login first.'=>'Це ім\'я користувача вже існує. Будь ласка, спробуйте ще раз або спочатку увійдіть.','This will affect the coupon usage stats, orders list, commission, and monthly summary.'=>'Це вплине на статистику використання купонів, список замовлень, комісію та щомісячний підсумок.','This will allow affiliate users to login to the dashboard if they visit the base dashboard URL.'=>'Це дозволить афілійованим користувачам увійти на інформаційну панель, якщо вони відвідають базову URL-адресу інформаційної панелі.','This will allow affiliates to click a toggle to only show converted clicks.'=>'Це дозволить афілійованим особам натискати перемикач, щоб показувати лише конвертовані кліки.','This will allow affiliates to filter through their whole click history with pagination.'=>'Це дозволить афіліатам фільтрувати всю історію кліків з нумерацією сторінок.','This will allow the affiliate user to replace the default link/URL in the "embed code" for each creative with their own URL.'=>'Це дозволить афілійованому користувачеві замінити посилання/URL за замовчуванням у «коді вбудовування» для кожного креативу на власну URL-адресу.','This will allow the affiliate user to select a campaign, which will update the URL in the "embed code" for each campaign to include the campaign tracking parameter.'=>'Це дозволить афілійованому користувачеві вибрати кампанію, яка оновить URL-адресу в «коді вбудовування» для кожної кампанії, включивши параметр відстеження кампанії.','This will allow them to add extra emails to send their email notifications to.'=>'Це дозволить їм додавати додаткові електронні листи для надсилання сповіщень електронною поштою.','This will also allow them to use their own referral link and earn commission on their own purchases.'=>'Це також дозволить їм використовувати власне реферальне посилання та отримувати комісію за власні покупки.','This will automatically apply the coupon every time at checkout for that visitor, until the cookie expires.'=>'Це автоматично застосовуватиме купон щоразу під час оформлення замовлення для цього відвідувача, доки не закінчиться термін дії файлу cookie.','This will be shown before the coupon code shown in the header of the affiliate dashboard page, for example you could set it to "Coupon code:".'=>'Це буде показано перед кодом купона, показаним у заголовку сторінки інформаційної панелі партнера, наприклад, ви можете встановити для нього значення "Код купона:".','This will determine how the orders are sorted on the affiliate dashboard, either by the day they were paid for, or the day it was set to completed.'=>'Це визначатиме, як замовлення сортуються на інформаційній панелі партнера за днем, за який вони були оплачені, або за день, коли було встановлено їх завершення.','This will disable automatic ajax saving, and instead will enable the "Save Settings" button, and you will save all settings at once.'=>'Це відключить автоматичне збереження ajax, а замість цього включить кнопку "Зберегти налаштування", і ви збережете всі налаштування одразу.','This will display a new "Rates" tab on the affiliate dashboard.'=>'Це відобразить нову вкладку "Ставки" на інформаційній панелі партнера.','This will enable "Creatives" in the admin menu, where you can upload your own banners (creatives) for affiliates to use.'=>'Це включить «Креативи» в меню адміністратора, де ви зможете завантажувати власні банери (креативи) для використання афіліатами.','This will enable "Performance Bonuses" in the admin menu, where you can add multiple different bonuses, with certain requirementse and rewards.'=>'Це включить «Бонуси за продуктивність» у меню адміністратора, де ви можете додати кілька різних бонусів з певними вимогами та винагородами.','This will enable payouts features, and keep track of "unpaid commission" for each coupon, whenever new orders are created using that coupon.'=>'Це дозволить увімкнути функцію виплат і відстежувати «невиплачену комісію» для кожного купона, коли нові замовлення створюються за допомогою цього купона.','This will enable the coupon affiliate registration features on your website.'=>'Це включить функції реєстрації партнера з купонами на вашому веб-сайті.','This will enable the coupon affiliate registration system on your website.'=>'Це включить систему реєстрації партнерів за купонами на вашому веб-сайті.','This will enable the Referral URL section on the affiliate dashboard which displays the referral URL generator, along with click statistics, conversion rates, and more.'=>'Це включить розділ «Реферальна URL-адреса» на інформаційній панелі партнера, який відображає генератор реферальних URL-адрес, а також статистику кліків, коефіцієнти конверсії тощо.','This will further increase initial loading speed/performance. It will only start loading content for each tab when the tab is clicked, showing the "loading..." animation whilst it loads.'=>'Це ще більше збільшить початкову швидкість/продуктивність завантаження. Він почне завантажувати вміст для кожної вкладки лише після натискання на вкладку, показуючи «завантаження...» анімацію під час її завантаження.','This will hide the bonus from the affiliate dashboard, but it will still be active and will grant rewards when achieved.'=>'Це приховає бонус з інформаційної панелі партнера, але він все одно буде активним і надасть винагороди при досягненні.','This will instantly create a new "gift" coupon for that affiliate to use as a discount on future orders they place themselves. This is NOT an affiliate coupon.'=>'Це миттєво створить новий «подарунковий» купон для цієї партнерки, яку він зможе використовувати як знижку на майбутні замовлення, які вони розміщують самостійно. Це НЕ партнерський купон.','This will instantly create a new order for that affiliate user, with the product at a 100% discount.'=>'Це миттєво створить нове замовлення для цього афілійованого користувача з продуктом зі знижкою 100%.','This will make it so when each tab is clicked, it reloads the page, but it only loads the content for the selected tab.'=>'Це зробить так, що при натисканні на кожну вкладку сторінка перезавантажується, але завантажується лише вміст вибраної вкладки.','This will make the initial page loading much faster for larger coupons, and show a "loading" animation in these sections whilst it loads content (usually takes no longer than a few seconds).'=>'Це зробить початкове завантаження сторінки набагато швидшим для великих купонів і покаже анімацію «завантаження» в цих розділах під час завантаження контенту (зазвичай займає не більше кількох секунд).','This will not apply the coupon discount to the order, it simply links the coupon/affiliate to that order for them to earn commission for it.'=>'Це не застосовуватиме знижку на купон до замовлення, воно просто пов\'язує купон/афіліату з цим замовленням, щоб вони могли заробити за це комісію.','This will not delete your orders or WooCommerce data. If you want to be safe, be sure to make a backup of your website beforehand in-case you want to restore this data.'=>'Це не призведе до видалення ваших замовлень або даних WooCommerce. Якщо ви хочете бути в безпеці, обов\'язково заздалегідь зробіть резервну копію свого веб-сайту на випадок, якщо ви захочете відновити ці дані.','This will only affect the affiliate dashboard statistics. Any unpaid commission granted will NOT be deducted.'=>'Це вплине лише на статистику партнерської панелі. Будь-яка надана несплачена комісія НЕ вираховується.','This will only be replaced for coupons with an affiliate assigned to it.'=>'Це буде замінено лише для купонів з призначеним їм партнером.','This will remove/deduct the tax amount from the store credit, if it is added to the credit amount in the cart.'=>'Це видалить/вирахує суму податку з кредиту магазину, якщо вона додана до суми кредиту в кошику.','This will replace it with this page:'=>'Це замінить його на цю сторінку:','This will replace your default WooCommerce email template "header image" with a custom one for your reports.'=>'Це замінить "зображення заголовка" вашого шаблону WooCommerce за замовчуванням на кастомний для ваших звітів.','This will show a "Landing Pages" section on the affiliate dashboard in the "Referral URL" tab, with all the assigned landing pages for the affiliate coupon.'=>'Це покаже розділ «Цільові сторінки» на інформаційній панелі партнера у вкладці «Реферальна URL-адреса» з усіма призначеними цільовими сторінками для партнерського купона.','This will show a "Payouts" tab on the coupon usage/info page, so the affiliate can view their unpaid commission, and request payouts.'=>'Це покаже вкладку «Виплати» на сторінці використання купонів/інформації про них, щоб партнер міг переглянути свою несплачену комісію та запросити виплати.','This will show a table with a log of the latest referral URL clicks/visits for the affiliate coupons referral URL (or selected campaign).'=>'Це покаже таблицю з журналом останніх кліків/відвідувань реферальної URL-адреси реферальних купонів (або вибраної кампанії).','This will show a toggle switch at the top right of the portal to switch between light and dark mode.'=>'Це покаже тумблер у верхньому правому куті порталу для перемикання між світлим і темним режимом.','This will show the affiliate application/registration form automatically on the affiliate page for logged out users (alongside the login form).'=>'Це автоматично відобразить форму заявки/реєстрації партнера на сторінці партнера для користувачів, які вийшли з системи (разом із формою входу).','This will show the current "Store Credit" for each user on the "All Users" admin page.'=>'Це покаже поточний "Кредит магазину" для кожного користувача на сторінці адміністратора "Усі користувачі".','This will show the Gravatar image and link to edit their gravatar in the "Settings" tab on the affiliate dashboard.'=>'Це покаже зображення Gravatar і посилання для редагування їхнього граватара у вкладці "Налаштування" на інформаційній панелі партнера.','This will show the WooCommerce "Account Details" fields directly in the "settings" tab on the affiliate dashboard, along with a logout link.'=>'Це покаже поля WooCommerce «Деталі облікового запису» безпосередньо у вкладці «Налаштування» на інформаційній панелі партнера разом із посиланням для виходу.','This will still show the "Last 30 Days" and "Last 7 Days". It will also cause the "usage" stat to be calculated slightly different.'=>'Тут все одно відображатимуться "Останні 30 днів" і "Останні 7 днів". Це також призведе до того, що статистика «використання» буде розрахована дещо інакше.','This will store a cookie in the visitors browser when they click on a referral link, so the referral can be tracked even if they do not register on their first page visit.'=>'Це зберігатиме файл cookie в браузері відвідувачів, коли вони натискають на реферальне посилання, тому реферала можна відстежити, навіть якщо він не зареєструється під час першого відвідування сторінки.','This will store a cookie in the visitors browser when they click on a referral link, to automatically apply the coupon code once they add items to their cart, and to track link stats better.'=>'Це зберігатиме файл cookie в браузері відвідувачів, коли вони натискають на реферальне посилання, щоб автоматично застосовувати код купона, коли вони додають товари до свого кошика, і краще відстежувати статистику посилань.','This will then automatically convert all the stats, order totals and commission on the affiliate dashboard into your base store currency, even if the order is made in a different currency.'=>'Потім це автоматично перетворить всю статистику, загальну суму замовлень і комісію на інформаційній панелі партнера у валюту вашого базового магазину, навіть якщо замовлення зроблено в іншій валюті.','This will work in the same way as if the user clicked the "Request Payout" button in their dashboard.'=>'Це працюватиме так само, як якщо б користувач натиснув кнопку «Запитати виплату» на своїй інформаційній панелі.','Threshold for automatic payouts'=>'Поріг для автоматичних виплат','Tier'=>'Рівень','Time'=>'Час','to'=>'до','To add new affiliates and assign them to a specific coupon, you can do any of the following 3 options:'=>'Щоб додати нових партнерів і призначити їм певний купон, ви можете зробити будь-який з наступних 3 варіантів:','To assign users to a specific coupon, go to the'=>'Щоб призначити користувачам певний купон, перейдіть до розділу','To completely refresh each of your affiliate dashboards stats for past orders, with the new conversion rates, %s and click "refresh all data". (The first page load for each dashboard may take slightly longer.)'=>'Щоб повністю оновити статистику кожної з ваших партнерських інформаційних панелей за минулі замовлення, вказавши нові коефіцієнти конверсії, %s і натисніть «оновити всі дані». (Перше завантаження сторінки для кожної інформаційної панелі може зайняти трохи більше часу.)','To customise the "Creatives" tab, please go to the creatives settings:'=>'Щоб налаштувати вкладку "Креативи", перейдіть до налаштувань креативів:','To customise the "Performance Bonuses", please go to the "Bonuses" settings:'=>'Щоб налаштувати "Бонуси за продуктивність", будь ласка, перейдіть до налаштувань "Бонуси":','To customise the "Referral Links" tab, please go to the referral URL settings:'=>'Щоб налаштувати вкладку "Реферальні посилання", перейдіть до налаштувань реферальної URL-адреси:','To display the affiliate application form on a custom page, use the shortcode: '=>'Щоб відобразити форму заявки на партнерство на користувацькій сторінці, використовуйте шорткод: ','To display the affiliate dashboard for the coupon(s) assigned to the logged in user use shortcode:'=>'Щоб відобразити інформаційну панель партнера для купонів, призначених користувачеві, який увійшов у систему, використовуйте шорткод:','To do this go to "Pro Settings" and toggle on "Enable lifetime commission features." option.'=>'Для цього перейдіть у «Налаштування Pro» та увімкніть опцію «Увімкнути функції довічної комісії».','to fully translate this plugin.'=>'щоб повністю перекласти цей плагін.','To get started with affiliate email reports, first enable it in the "PRO Modules" section of the settings, then setup and customise the settings in the new "Reports" settings tab that will appear.'=>'Щоб почати працювати зі звітами на партнерські листи, спочатку увімкніть їх у розділі налаштувань «PRO-модулі», а потім налаштуйте та налаштуйте параметри у новій вкладці налаштувань «Звіти», що з\'явиться.','To get started with affiliate registration, you will need to add this shortcode to a NEW page:'=>'Щоб розпочати реєстрацію партнера, вам потрібно буде додати цей шорткод на НОВУ сторінку:','To get started with creatives, first go to the "Creatives" settings to to enable and customise the settings.'=>'Щоб розпочати роботу з креативами, спочатку перейдіть до налаштувань «Креативи», щоб увімкнути та налаштувати параметри.','To get started with Multi-Currency support, simply enable "multi-currency settings" under the "General" settings tab. A new tab will the appear labeled "currencies" to customise your currencies and conversion rates.'=>'Щоб розпочати роботу з підтримкою мультивалюти, просто увімкніть «налаштування мультивалюти» на вкладці налаштувань «Загальні». На новій вкладці з\'явиться напис "валюти" для налаштування валют і курсів конвертації.','To get started with multi-level affiliates, you will need to create the MLA dashboard page. Simply add this shortcode to a new page:'=>'Щоб розпочати роботу з багаторівневими афіліатами, вам потрібно створити сторінку інформаційної панелі MLA. Просто додайте цей шорткод на нову сторінку:','To get started with this integration, you first need to install and activate the "%s" plugin.'=>'Щоб розпочати роботу з цією інтеграцією, вам спочатку потрібно встановити та активувати плагін "%s".','To get started, simply enable the "Affiliate Landing Pages" option in "Pro Settings" then you will see a new meta box when editing pages, to assign an affiliate coupon to that page.'=>'Щоб розпочати, просто включіть опцію «Партнерські цільові сторінки» в «Налаштуваннях Pro», тоді ви побачите нове мета-поле під час редагування сторінок, щоб призначити партнерський купон цій сторінці.','To manage (and enable) email notifications for affiliate applications, go to the "Emails" settings tab.'=>'Щоб керувати (і включити) сповіщення електронною поштою для партнерських додатків, перейдіть на вкладку налаштувань «Електронні листи».','To manage (and enable) email notifications for payouts, go to the "Emails" settings tab.'=>'Щоб керувати (і ввімкнути) сповіщення на email про виплати, перейдіть на вкладку налаштувань "Електронні листи".','To manage/customise the email notifications for new direct link tracking domain requests, go to the "Emails" settings tab.'=>'Щоб керувати/налаштовувати сповіщення електронною поштою для нових запитів домену відстеження прямих посилань, перейдіть на вкладку налаштувань "Електронні листи".','To manually edit/change "unpaid commission" for a coupon, go to the'=>'Щоб вручну відредагувати/змінити "неоплачену комісію" для купона, перейдіть до розділу','To request a payout, you firstly need to enter your payment details in the settings tab.'=>'Щоб запросити виплату, спочатку потрібно ввести свої платіжні дані у вкладці налаштувань.','to show a list of all the payouts.'=>', щоб відобразити список усіх виплат.','to show a list of the products purchased (and quantities).'=>', щоб відобразити список придбаних продуктів (і їх кількість).','to show the account username.'=>', щоб відобразити ім\'я користувача облікового запису.','to show the admin URL to manage payouts.'=>', щоб відобразити URL-адресу адміністратора для керування виплатами.','to show the admin URL.'=>', щоб відобразити URL-адресу адміністратора.','to show the affiliate dashboard URL.'=>', щоб відобразити URL-адресу інформаційної панелі партнера.','to show the affiliate registration "How did you hear about us?" field value.'=>'щоб показати значення поля реєстрації партнера "Як ви про нас дізналися?".','to show the affiliate registration "How will you promote us?" field value.'=>'щоб показати значення поля реєстрації афіліта «Як ви будете нас просувати?».','to show the affiliate registration "Website" field value.'=>'щоб відобразити значення поля "Веб-сайт" реєстрації партнера.','to show the affiliate registration custom field values.'=>', щоб відобразити користувацькі значення полів реєстрації партнера.','to show the affiliates default referral URL.'=>', щоб показати URL-адресу реферала афіліатів за замовчуванням.','to show the amount.'=>', щоб показати суму.','to show the coupon code.'=>', щоб відобразити код купона.','to show the custom message entered when admins accept/decline affiliate registrations.'=>', щоб відобразити спеціальне повідомлення, введене під час прийняття/відхилення реєстрацій адміністраторів.','to show the domain.'=>', щоб відобразити домен.','to show the fixed MLA commission earned.'=>'щоб відобразити фіксовану зароблену комісію за MLA.','to show the invite referral UR (with hyperlink) for the registration form.'=>'для відображення UR запрошеного реферала (з гіперпосиланням) для реєстраційної форми.','to show the invite referral URL without hyperlink (to create your own link/button).'=>'щоб відобразити URL-адресу запрошення реферала без гіперпосилання (для створення власного посилання/кнопки).','to show the number.'=>', щоб відобразити номер.','to show the order ID.'=>', щоб відобразити ідентифікатор замовлення.','to show the order status.'=>', щоб відобразити статус замовлення.','to show the password reset URL.'=>', щоб відобразити URL-адресу для скидання пароля.','to show the payout method.'=>', щоб відобразити спосіб виплати.','to show the percentage MLA commission earned.'=>', щоб відобразити відсоток отриманої комісії за MLA.','to show the users commission earned on that order.'=>'щоб відобразити комісію користувачів, зароблену на цьому замовленні.','to show the users display name.'=>', щоб відобразити відображуване ім\'я користувача.','to show the users email address.'=>', щоб відобразити адресу електронної пошти користувача.','to the sub-affiliate username.'=>'на ім\'я користувача суб-партнера.','To view a list of all the different shortcodes available to use with this plugin'=>'Щоб переглянути список усіх різноманітних шорткодів, доступних для використання з цим плагіном','To view all available PRO modules, simply visit the "Pro Modules" tab on the settings page, and enable the modules you want to use.'=>'Щоб переглянути всі доступні PRO-модулі, просто перейдіть на вкладку «Pro Модулі» на сторінці налаштувань і активуйте модулі, які ви хочете використовувати.','To view all features available with PRO, visit our website:'=>'Щоб переглянути всі функції, доступні з PRO, відвідайте наш сайт:','Total'=>'Підсумок','Total Affiliates'=>'Всього афіліатів','Total Clicks'=>'Загальна кількість кліків','Total Commission'=>'Загальна комісія','Total Commission Earned'=>'Загальна зароблена комісія','Total commission earned this month'=>'Загальна комісія, зароблена цього місяця','Total Conversions'=>'Загальна кількість конверсій','Total Coupon Usage'=>'Загальне використання купона','Total Discounts'=>'Всього знижок','Total Number of Orders'=>'Загальна кількість замовлень','Total number of orders'=>'Загальна кількість замовлень','Total number of orders all time'=>'Загальна кількість замовлень за весь час','Total number of orders this month'=>'Загальна кількість замовлень за цей місяць','Total number of orders this year'=>'Загальна кількість замовлень в поточному році','Total Referrals'=>'Всього рефералів','Total Sales'=>'Загальний обсяг продажів','total sales'=>'Загальний обсяг продажів','Total Sales Referred'=>'Загальна кількість рекомендованих продажів','Total sales referred'=>'Загальна кількість рекомендованих продажів','Total sales referred this month'=>'Загальний обсяг продажів за цей місяць','Total sales referred this year'=>'Загальний обсяг продажів цього року','Total Usage'=>'Загальне використання','total usage'=>'Загальне використання','Totals'=>'Підсумки','Track all new referral URL clicks from the same visitor/user.'=>'Відстежуйте всі нові переходи за реферальними URL-адресами від одного і того ж відвідувача/користувача.','Track conversions via referral URL even if coupon was not used.'=>'Відстежуйте конверсії за допомогою реферальної URL-адреси, навіть якщо купон не був використаний.','Track user registrations as a lifetime referral.'=>'Відстежуйте реєстрації користувачів як довічного реферала.','Tracking URL Conversions Without Coupon'=>'Відстеження URL-конверсій без купона','Translations'=>'Переклади','Trigger (Requirements)'=>'Тригер (вимоги)','Turn this off if you want to show all their payout details on the payouts tab, but payouts requests themselves will all be handled by admins (or scheduled).'=>'Вимкніть цю функцію, якщо ви хочете відображати всі деталі про виплати на вкладці виплат, але самі запити на виплати оброблятимуться адміністраторами (або виконуватимуться за розкладом).','Turn this option on to disable the user search/picker, and to just enter the user ID manually.'=>'Увімкніть цю опцію, щоб вимкнути пошук/вибір користувачів, і просто ввести ідентифікатор користувача вручну.','TutorLMS – Integration Guide'=>'TutorLMS – Посібник з інтеграції','Twitter Text'=>'Текст у Твіттері','Type'=>'Тип','Unless you have a specific use case, we suggest keeping this disabled as in general it can cause some issues (commission granted to all coupons).'=>'Якщо у вас немає конкретного випадку використання, ми рекомендуємо залишити це вимкненим, оскільки загалом це може спричинити деякі проблеми (комісія надається всім купонами).','Unlimited'=>'Необмежений','Unlimited date range selection is available with the'=>'Необмежений вибір діапазону дат доступний за допомогою кнопки','Unpaid'=>'Неоплачувану','Unpaid Commission'=>'Несплачена комісія','unpaid commission'=>'несплачена комісія','Unpaid Commission granted to affiliate, ready for payout request.'=>'Невиплачена комісія надана партнеру, готовому до запиту на виплату.','Unpaid Commission not granted to affiliate. Since this order is completed it will no longer grant commission and needs applying manually if you wish to reward commission for this order. Click the "update" link.'=>'Невиплачена комісія не надається афілійованій особі. Оскільки це замовлення виконано, воно більше не надаватиме комісію та потребує подання вручну, якщо ви хочете винагородити комісію за це замовлення. Натисніть на посилання "оновити".','Unpaid Commission not yet granted to affiliate. This will be granted when the order is completed.'=>'Невиплачена комісія ще не надана партнеру. Ця вимога буде надана після виконання замовлення.','Unpaid commission will also NOT be automatically granted to this affiliate coupon and should be done manually.'=>'Несплачена комісія також НЕ буде автоматично надана цьому партнерському купону і повинна бути надана вручну.','unpaid commission, and also meet any other requirements such as payment threshold, and payout details.'=>'невиплаченої комісії, а також відповідати будь-яким іншим вимогам, таким як поріг платежу та реквізити для виплати.','Unpaid Commission:'=>'Несплачена комісія:','Update Bonus'=>'Бонус за оновлення','Update Creatives'=>'Оновити креативи','Update Registration Page?'=>'Оновити сторінку реєстрації?','UPGRADE'=>'ОНОВЛЕННЯ','Upgrade Now'=>'Оновити зараз','Upgrade to Pro'=>'Перейдіть на Pro','Upgrade to unlock this module.'=>'Оновіть, щоб розблокувати цей модуль.','Upload Invoice'=>'Завантажити рахунок-фактуру','Upon approval, they can then directly link to your site, directly from theirs, without needing to use a referral URL, and it will still be tracked.'=>'Після схвалення вони можуть безпосередньо посилатися на ваш сайт, безпосередньо зі свого, без необхідності використовувати реферальну URL-адресу, і він все одно буде відстежуватися.','Upon new registration, assign user to custom "coupon affiliate" user role.'=>'Після нової реєстрації призначте користувача на спеціальну роль користувача "партнер за купоном".','Uppercase'=>'Великі','URL conversion rate'=>'Коефіцієнт конверсії URL','URL Conversion Tracking'=>'Відстеження конверсій URL','URL Settings'=>'Налаштування URL','Usage'=>'Використання','Usage Limits'=>'Обмеження використання','Use merge tag {credit} to show the amount of credit they can apply.'=>'Використовуйте тег злиття {credit}, щоб показати суму кредиту, яку вони можуть застосувати.','Use the email address as username.'=>'Використовуйте адресу електронної пошти як ім\'я користувача.','Use the following settings customise creative template. A unique creative will then be generated and displayed for each affiliate on the creatives tab.'=>'Використовуйте наступні налаштування: налаштуйте креативний шаблон. Після цього буде згенеровано унікальний креатив, який відображатиметься для кожного партнера на вкладці «Креативи».','Use this page to manually add a new affiliate registration.'=>'Використовуйте цю сторінку, щоб вручну додати нову реєстрацію партнера.','Use this quick form to generate a template coupon code automatically with the basic default settings. You can customise the more advanced coupon settings later if needed.'=>'Використовуйте цю швидку форму для автоматичної генерації шаблонного коду купона з основними налаштуваннями за замовчуванням. Ви можете налаштувати більш розширені параметри купонів пізніше, якщо це буде потрібно.','Use this tool to bulk edit your coupon settings.'=>'Використовуйте цей інструмент для масового редагування налаштувань купонів.','Use this tool to bulk edit your per-product commission settings. The username must exist or it will not be updated.'=>'Використовуйте цей інструмент для масового редагування налаштувань комісії за кожен продукт. Ім\'я користувача має існувати, інакше воно не оновиться.','Use {company} to insert the affiliate company name.'=>'Використовуйте {company}, щоб вставити назву партнерської компанії.','Use {coupon} to insert the coupon code.'=>'Використовуйте {coupon}, щоб вставити код купона.','Use {discount} to insert the coupon discount percentage or fixed amount.'=>'Використовуйте {discount}, щоб вставити відсоток знижки купона або фіксовану суму.','Use {first-name} to insert the affiliate first name.'=>'Використовуйте {first-name}, щоб вставити ім\'я партнера.','Use {qrcode} to insert the a QR code of the affiliate default referral URL.'=>'Використовуйте {qrcode}, щоб вставити QR-код URL-адреси реферала партнера за замовчуванням.','Use {username} to insert the affiliate username.'=>'Використовуйте {username}, щоб вставити ім\'я користувача партнера.','Used when describing the store credit payment/transaction in the logs.'=>'Використовується при описі платежу/транзакції кредиту магазину в журналах.','Useful if you simply want a generic "affiliate" page to direct affiliates to, instead of a unique link for each one.'=>'Корисно, якщо вам просто потрібна загальна «партнерська» сторінка, на яку можна спрямовувати партнерів, замість унікального посилання для кожної з них.','User'=>'Користувач','User ID'=>'Ідентифікатор користувача','User Registration'=>'Реєстрація користувача','User Restrictions'=>'Обмеження для користувачів','User Role'=>'Роль користувача','User role required for plugin admin capabilities:'=>'Обов\'язкова роль користувача для можливостей адміністратора плагіна:','User role:'=>'Роль користувача:','Username'=>'Ім\'я користувача','Users combined total commission from referral link and their MLA sub-affiliates.'=>'Користувачі об\'єднали загальну комісію від реферального посилання та їхніх суб-партнерів MLA.','Using One License for Live & Staging Sites'=>'Використання однієї ліцензії для живих і підготовчих сайтів','Vertical Margin (Y):'=>'Вертикальне поле (Y):','via'=>'Через','View "Creatives" Settings'=>'Перегляд налаштувань "Креативи"','View "Direct Link Tracking" Settings'=>'Переглянути налаштування "Відстеження прямих посилань"','View a log of all the activity that has taken place in your affiliate program.'=>'Переглядайте журнал усіх активностей, які відбулися у вашій партнерській програмі.','View Affiliate Dashboard'=>'Переглянути інформаційну панель партнера','View affiliate dashboard'=>'Переглянути інформаційну панель партнера','View All Documentation'=>'Переглянути всю документацію','View all visits for this campaign name.'=>'Перегляньте всі відвідування цієї кампанії з назвою.','View all visits for this coupon.'=>'Переглянути всі відвідування за цим купоном.','View all visits for this referrer.'=>'Переглянути всі відвідування цього реферера.','View all your coupons, and links to each of their dashboards on the <a href="%s" target="_blank">coupons list</a> page.'=>'Перегляньте всі свої купони та посилання на кожну з їхніх інформаційних панелей на сторінці <a href="%s" target="_blank">зі списком купонів</a> .','View Bonus'=>'Переглянути бонус','VIEW BONUSES'=>'ПЕРЕГЛЯНУТИ БОНУСИ','View Bonuses'=>'Переглянути бонуси','View Changelog'=>'Переглянути журнал змін','View Coupons List & Unique Links'=>'Переглянути список купонів та унікальні посилання','VIEW CREATIVES'=>'ПЕРЕГЛЯНУТИ КРЕАТИВИ','View Creatives'=>'Переглянути креативи','View Dashboard'=>'Переглянути інформаційну панель','View Documentation'=>'Переглянути документацію','View in PayPal'=>'Переглянути в PayPal','View in Stripe'=>'Переглянути в Stripe','View Landing Page'=>'Переглянути цільову сторінку','View More'=>'Дивитись більше','View Order in Backend (Admin Only)'=>'Перегляд порядку в серверній частині (лише для адміністраторів)','View Page'=>'Переглянути сторінку','View Product'=>'Переглянути товар','View Reports'=>'Перегляд звітів','View setup guide'=>'Переглянути інструкцію з налаштування','View the affiliate dashboard for this affiliate coupon.'=>'Перегляньте інформаційну панель партнера для цього партнерського купона.','View transaction in PayPal.'=>'Переглядайте транзакцію в PayPal.','View transaction in Stripe.'=>'Перегляд транзакції в Stripe.','Viewing as'=>'Перегляд як','Viewing as:'=>'Перегляд як:','Viewing MLA dashboard for user:'=>'Перегляд панелі MLA для користувача:','Visibility Settings'=>'Налаштування видимості','Visit Date'=>'Дата візиту','Visit the <a href="%s" target="_blank">settings page</a> to edit more options, and customise your affiliate program to work exactly how you want!'=>'Відвідайте <a href="%s" target="_blank">сторінку налаштувань</a> , щоб відредагувати більше опцій і налаштувати свою партнерську програму, щоб вона працювала саме так, як ви хочете!','Visitor ID'=>'Ідентифікатор відвідувача','Visitors Blacklist'=>'Чорний список відвідувачів','Visitors referred directly from any of these domains will not have referrals tracked or coupons applied automatically.'=>'Відвідувачам, які перейшли безпосередньо з будь-якого з цих доменів, не буде відслідковуватися рефералів або автоматично застосовуватися купони.','Wallet System'=>'Система гаманців','Want more advanced coupon usage restrictions? Check out our %s plugin!'=>'Хочете більше розширених обмежень щодо використання купонів? Ознайомтеся з нашим плагіном %s!','Want more advanced coupon usage restrictions? Check out the %s plugin.'=>'Хочете більше розширених обмежень щодо використання купонів? Ознайомтеся з плагіном %s.','Want more advanced features?'=>'Хочете більше розширених функцій?','Want us to create a new plugin integration?'=>'Хочете, щоб ми створили нову інтеграцію плагінів?','Warning: If you use this option, you should be even more careful of fraudulent activity. We do recommend reviewing and accepting payouts manually instead, simply so you can make sure each payout is valid and non-fraudulent.'=>'Увага: Якщо ви використовуєте цю опцію, вам слід бути ще обережнішими з шахрайськими діями. Натомість ми рекомендуємо переглядати та приймати виплати вручну, щоб ви могли переконатися, що кожна виплата дійсна та не є шахрайською.','Warning: You will want to create a "template coupon" and assign it in the settings for affiliate coupons to be generated properly.'=>'Попередження: Ви захочете створити «шаблонний купон» і призначити його в налаштуваннях, щоб партнерські купони були згенеровані належним чином.','was updated'=>'було оновлено','We are going to run you through some of the most important settings in the Coupon Affiliates plugin, to help you get everything setup!'=>'Ми проведемо вас через деякі з найважливіших налаштувань у плагіні Coupon Affiliates, щоб допомогти вам все налаштувати!','We are reviewing your application and will be in touch soon!'=>'Ми розглядаємо вашу заявку і зв\'яжемося з вами найближчим часом!','We highly recommend that you keep this option DISABLED, as it may cause some issues or paying too much commission.'=>'Ми настійно рекомендуємо вам залишити цю опцію ВИМКНЕНОЮ, оскільки вона може спричинити деякі проблеми або сплатити занадто велику комісію.','Website'=>'Веб-сторінка','Weekly'=>'Щотижневий','Welcome to the Coupon Affiliates setup wizard!'=>'Ласкаво просимо до майстра налаштування партнерів з купонами!','What happens when an order is refunded or partially refunded?'=>'Що відбувається при поверненні або частковому поверненні коштів за замовлення?','What is a "coupon-based" affiliate program?'=>'Що таке партнерська програма на основі купонів?','What should happen after form submission?'=>'Що має відбутися після відправки форми?','What time of the day should payouts be requested automatically?'=>'В який час доби виплати повинні запитуватися автоматично?','What time of the day should reports be sent?'=>'В який час доби потрібно надсилати звіти?','What toggles should be shown for statistics and line graphs?'=>'Які перемикачі повинні бути показані для статистики та лінійних графіків?','What type of coupon would you like?'=>'Який тип купона вам би сподобався?','WhatsApp Text'=>'Текст WhatsApp','When a payout request is submitted, you will be able to view, manage, and pay it from the admin "<a href="%s">Payouts</a>" page.'=>'Коли запит на виплату буде надіслано, ви зможете переглядати, керувати та виплачувати його зі сторінки "<a href="%s">Виплати</a>" адміністратора.','When a referral coupon is applied, if the discount is "0.00", it will hide the 0.00 discount line on the checkout page.'=>'При застосуванні реферального купона, якщо знижка становить «0,00», він приховає рядок знижки 0,00 на сторінці оформлення замовлення.','When a user submits the form, you will be notified, and can review the application in the admin "Registrations" page.'=>'Коли користувач надішле форму, ви отримаєте сповіщення, і зможете переглянути заявку на сторінці "Реєстрації" адміністратора.','When an affiliate adds a new domain to their account, an email will be sent to your admin email, with a link to approve or deny the domain.'=>'Коли партнер додасть новий домен до свого облікового запису, на вашу електронну пошту адміністратора буде надіслано електронний лист із посиланням для схвалення або відхилення домену.','When approved, it will generate a coupon code automatically, and assign it to that affiliate user.'=>'Після схвалення він автоматично згенерує код купона та призначить його цьому афілійованому користувачу.','When assigning users to coupons, if this is enabled, it will only show the list of users with the custom "coupon affiliate" role.'=>'Під час призначення користувачам купонів, якщо це увімкнено, він показуватиме лише список користувачів із власною роллю «партнер купонів».','When checked, this coupon can only be used by new customers on their first order.'=>'Якщо поставити галочку, цей купон можуть використати лише нові клієнти під час першого замовлення.','When completing this form, it will automatically submit an approved affiliate registration for that user, automatically creating the coupon and assigning them to it.'=>'Заповнивши цю форму, він автоматично надішле схвалену реєстрацію партнера для цього користувача, автоматично створивши купон і призначивши їх йому.','When disabled, if there are no users assigned to a coupon, the dashboard can be viewed by anyone if they visit the unique URL directly. However, if there is a user assigned to it, the URL will be private.'=>'Якщо цей параметр вимкнено, якщо на купон не призначено користувачів, інформаційну панель може переглядати будь-хто, якщо він перейде за унікальною URL-адресою безпосередньо. Однак, якщо йому призначено користувача, URL-адреса буде приватною.','When disabled, if you change commission rates, it will automatically update the stats/commission for ALL new and past orders on the affiliate dashboard.'=>'При відключенні, якщо ви зміните ставки комісійних, він автоматично оновить статистику/комісію для ВСІХ нових і минулих замовлень на інформаційній панелі партнера.','When disabled, it will only allow 1 affiliate coupon to be used per order. (This is any coupons that have an affiliate user assigned to them.)'=>'Якщо його вимкнено, це дозволить використовувати лише 1 партнерський купон на одне замовлення. (Це будь-які купони, за якими призначено афілійованого користувача.)','When disabled, the affiliate user will be prevented from using their own coupon code (coupons they are assigned to) at cart or checkout.'=>'Якщо вимкнено, афілійований користувач не зможе використовувати власний код купона (купони, яким вони призначені) під час кошика або оформлення замовлення.','When enabled, % commission will be calculated based on the order subtotal/total including "fees". It will also be added to the subtotal/total shown in statistics.'=>'Коли увімкнено, % комісії буде розраховуватися на основі проміжного підсумку/загальної суми замовлення, включаючи "комісії". Він також буде доданий до проміжного підсумку/підсумку, показаного в статистиці.','When enabled, % commission will be calculated based on the order subtotal/total including "shipping costs".'=>'Якщо увімкнено, % комісії буде розраховуватися на основі проміжного підсумку/загальної суми замовлення, включаючи «вартість доставки».','When enabled, % commission will be calculated before any custom discounts are deducted from the subtotal/total. It will also be added to the subtotal/total shown in statistics.'=>'Якщо увімкнено, % комісії буде розраховуватися перед вирахуванням будь-яких спеціальних знижок із середньої/загальної суми. Він також буде доданий до проміжного підсумку/підсумку, показаного в статистиці.','When enabled, % commission will be calculated on the order subtotal (instead of total), before the coupon discount is deducted from it.'=>'Коли увімкнено, % комісії буде нараховуватися на проміжну суму замовлення (замість total), до того, як з нього буде вирахувано знижку за купоном.','When enabled, a "MLA Dashboard" link will be shown on the normal coupon affiliate dashboard, at the top right, next to the "Logout" link.'=>'Коли увімкнено, посилання «MLA Dashboard» буде показано на звичайній інформаційній панелі партнера з купонами, у верхньому правому куті, поруч із посиланням «Вийти».','When enabled, a "statement" PDF file will be generated automatically whenever payout requests are made by the affiliate. These statements show the payout details, status, company information, etc.'=>'Коли цей параметр увімкнено, PDF-файл «виписки» генеруватиметься автоматично щоразу, коли партнер надсилатиме запити на виплату. Ці виписки показують деталі виплати, статус, інформацію про компанію тощо.','When enabled, a new "Payout Statement Details" section is displayed in the "Settings" tab of the affiliate dashboard, to enter their billing data to show on statements.'=>'Коли це увімкнено, у вкладці «Налаштування» інформаційної панелі партнера відображається новий розділ «Деталі виписки про виплату», щоб ввести їхні платіжні дані для відображення у виписках.','When enabled, a new checkbox will appear on store checkout, under order notes, for them to join the affiliate program. This will submit an affiliate registration application for the user.'=>'Коли увімкнено, на касі магазину, під примітками до замовлень, з\'явиться новий прапорець, щоб вони могли приєднатися до партнерської програми. Це призведе до подання заявки на реєстрацію партнера для користувача.','When enabled, affiliates can download a statement for both pending and completed payouts. If disabled, they can only download statements for completed payouts.'=>'Коли це увімкнено, партнери можуть завантажувати виписку як для очікуваних, так і для завершених виплат. Якщо цей параметр вимкнено, вони можуть завантажувати лише виписки за виконані виплати.','When enabled, ALL the parent affiliates calculated commissions (from every tier) will be deducted from the main sub-affiliates earned commission amount for each order.'=>'Коли увімкнено, ВСІ розраховані комісійні батьківських партнерів (з кожного рівня) будуть вираховуватися з суми комісійних, зароблених основними суб-партнерами за кожне замовлення.','When enabled, all unique affiliate dashboard URLs will ALWAYS be private, and only be visible to the assigned user (and admins).'=>'Коли увімкнено, усі унікальні URL-адреси партнерської панелі ЗАВЖДИ будуть приватними та видимими лише призначеному користувачу (та адміністраторам).','When enabled, commission statistics are disabled/hidden for coupons that are not assigned to an affiliate user.'=>'Коли увімкнено, статистика комісійних вимкнена/прихована для купонів, які не призначені афілійованому користувачу.','When enabled, commission will be calculated and displayed on the affiliate dashboard.'=>'Коли увімкнено, комісія буде нараховуватися та відображатися на інформаційній панелі партнера.','When enabled, if a customer uses an MLA users affiliate coupon code in an order, that customer will also automatically be assigned as a sub-affiliate in their MLA network (if not already assigned to one).'=>'Якщо цей параметр увімкнено, якщо клієнт використовує код купона партнера MLA у замовленні, цей покупець також буде автоматично призначений як субпартнер у своїй мережі MLA (якщо його ще не призначено).','When enabled, if an MLA invite link is visited, the link will also work like a normal affiliate referral link, to apply the coupon to cart and track affiliate referrals if they place an order.'=>'Коли увімкнено, якщо ви перейдете за посиланням-запрошенням MLA, посилання також працюватиме як звичайне реферальне посилання для партнерів, щоб застосувати купон до кошика та відстежувати рефералів партнерів, якщо вони розміщують замовлення.','When enabled, the "Request Payout" button will be shown on the affiliate dashboard, allowing affiliates to manually request payouts.'=>'Коли увімкнено, кнопка «Запит на виплату» буде показана на інформаційній панелі партнера, що дозволить афіліатам вручну запитувати виплати.','When enabled, the affiliate can enter a custom amount for their payout request. The minimum amount will still be the payment threshold, and maximum amount is their total available unpaid commission.'=>'Коли це ввімкнено, партнер може ввести спеціальну суму для свого запиту на виплату. Мінімальна сума все одно буде порогом платежу, а максимальна сума – це загальна доступна несплачена комісія.','When enabled, the affiliate will be required to enter their payment details before they can request a payout.'=>'Коли це увімкнено, партнер повинен буде ввести свої платіжні дані, перш ніж він зможе запросити виплату.','When enabled, the checkbox to join the affiliate program will be checked automatically.'=>'Коли увімкнено, галочка для приєднання до партнерської програми буде встановлена автоматично.','When enabled, the PAST orders will not be affected (even if clicking "refresh data"), and it will only set the updated rates for NEW orders. The only time it WILL be updated is if an order is refunded.'=>'Коли увімкнено, це не вплине на PAST замовлення (навіть якщо натиснути "оновити дані"), а лише встановить оновлені ставки для НОВИХ замовлень. Єдиний раз, коли він буде оновлений, це якщо замовлення буде повернуто назад.','When enabled, the unpaid commission will also not be added to non-affiliate coupons.'=>'Коли увімкнено, несплачена комісія також не буде додана до купонів, що не належать партнеру.','When enabled, this will also show the adjusted "total" and "subtotal" (with deducted percentage) on affiliate dashboard. When disabled, only the "commission" stat will be affected by the adjustment.'=>'Коли це увімкнено, це також покаже скоригований «підсумок» і «проміжний підсумок» (з відніманням відсотка) на інформаційній панелі партнера. Якщо вимкнено, коригування впливатиме лише на статистику «комісія».','When enabled, visitors referred by blocked domains will be completely blocked from entering any affiliate coupons manually (as long as the cookie is saved).'=>'Коли це ввімкнено, відвідувачам, перенаправленим заблокованими доменами, буде повністю заблоковано можливість вводити будь-які партнерські купони вручну (за умови збереження файлу cookie).','When selected, a "Status" dropdown will be shown as an option when filtering by date range. Will only show if you have more than 1 status enabled.'=>'Якщо вибрати цей параметр, під час фільтрації за діапазоном дат з\'явиться спадне меню "Статус". Покажеться, лише якщо у вас увімкнено більше 1 статусу.','When selected, below the orders table it will show the total number of orders for each status. The "Status" column needs to be enabled.'=>'Якщо цей параметр вибраний, під таблицею замовлень буде відображатися загальна кількість замовлень для кожного статусу. Колонку "Статус" потрібно включити.','When selected, the totals for all orders within the selected date range will be shown in a new row at the bottom of the recent orders and monthly summary table.'=>'Якщо цей параметр вибрано, підсумки всіх замовлень у вибраному діапазоні дат відображатимуться в новому рядку внизу останніх замовлень і підсумкової таблиці за місяць.','When someone uses the referral URL, if the code is automatically applied, it will show this message on all pages.'=>'Коли хтось використовує URL-адресу переходу, якщо код застосовується автоматично, це повідомлення буде відображатися на всіх сторінках.','When they submit the affiliate registration form you can then view and edit the coupon code they have entered, before approving the affiliate registration.'=>'Коли вони надішлють форму реєстрації партнера, ви можете переглянути та відредагувати введений ними код купона, перш ніж схвалити реєстрацію партнера.','When updating these settings, you may need to click the "REFRESH ALL DATA" button in the "Debug" tab for changes to show immediately for existing orders.'=>'При оновленні цих налаштувань вам може знадобитися натиснути кнопку «ОНОВИТИ ВСІ ДАНІ» у вкладці «Налагодження», щоб зміни відразу відображалися для існуючих замовлень.','When you accept an affiliate, a new coupon is created with the same settings, and is automatically assigned to user.'=>'Коли ви приймаєте партнерську програму, новий купон створюється з тими ж налаштуваннями та автоматично призначається користувачу.','When you create an affiliate user, or accept an affiliate registration, their coupon code is automatically created and assigned to them. They will automatically be sent an email which includes a link to their dashboard. You can customize this email in the plugin settings.'=>'Коли ви створюєте афілійованого користувача або приймаєте реєстрацію партнера, його код купона автоматично створюється та призначається йому. Їм автоматично буде надіслано електронний лист із посиланням на їхню інформаційну панель. Ви можете налаштувати цей лист у налаштуваннях плагіна.','Where can I get plugin support?'=>'Де я можу отримати підтримку плагінів?','where product ID is'=>'де ідентифікатор товару','Which custom commission values should be applied as priority?'=>'Які митні значення комісійних мають бути застосовані в пріоритеті?','Who can apply affiliate coupons to their cart?'=>'Хто може застосувати партнерські купони до свого кошика?','With admin reports, you can view statistics and analytics for all your coupons and affiliates.'=>'За допомогою звітів адміністратора ви можете переглядати статистику та аналітику для всіх ваших купонів і партнерів.','With lifetime commission enabled, once someone uses the affiliates coupon code, that customer will be linked to the affiliate forever, and ALL future purchases from that customer and will count as a referral, even if they dont re-use the coupon code.'=>'З увімкненою довічною комісією, як тільки хтось використає код купона для партнерів, цей клієнт буде пов\'язаний з партнером назавжди, а ВСІ майбутні покупки від цього клієнта та будуть зараховані як реферал, навіть якщо вони не використають код купона повторно.','With the "[couponaffiliates]" shortcode, when a user visits this page (without the unique URL ID), enable to show full affiliate dashboard automatically if the affiliate user is only assigned to one coupon.'=>'За допомогою короткого коду «[couponaffiliates]», коли користувач відвідує цю сторінку (без унікального ідентифікатора URL-адреси), увімкніть автоматичний показ повної інформаційної панелі партнера, якщо партнерському користувачеві призначено лише один купон.','With the free version, you will need to manually handle payouts and payment details. There are a few ways that you can do this, such as generating a detailed admin report. <a href="%s">Click here to learn more.</a>'=>'У безкоштовній версії вам потрібно буде вручну обробляти виплати та платіжні реквізити. Це можна зробити кількома способами, наприклад, створити детальний звіт адміністратора. <a href="%s">Натисніть тут, щоб дізнатися більше.</a>','With the Multi-Level Affiliates module, your existing affiliates can invite new users to register as an affiliate on your website.'=>'За допомогою модуля «Багаторівневі партнери» ваші існуючі партнери можуть запрошувати нових користувачів зареєструватися як партнер на вашому веб-сайті.','With the PRO version can also set commission rates per each individual affiliate/coupon, or product.'=>'У версії PRO також можна встановлювати ставки комісії за кожного окремого партнера/купона або продукту.','With the Pro version get access to unlimited date range on the admin reports, export to CSV, and access to date comparison features, to compare analytics between 2 sets of dates'=>'З версією Pro отримайте доступ до необмеженого діапазону дат у звітах адміністратора, експорту в CSV та доступ до функцій порівняння дат, щоб порівнювати аналітику між 2 наборами дат','with the settings you want the gift coupons to include, and enter the name here. The new gift coupons generated will copy all the settings from this template.'=>'У налаштуваннях, які ви хочете включити в подарункові купони, і введіть назву тут. Нові подарункові купони будуть скопійовані всі налаштування з цього шаблону.','With this disabled, only logged in users can apply.'=>'Якщо цей параметр вимкнено, лише користувачі, які ввійшли в систему, можуть подати заявку.','With this enabled commission will be paid instantly into the affiliate account automatically, as soon as they request a payout. This will apply to Stripe, PayPal and Store Credit payout methods.'=>'При цьому комісія буде виплачуватися миттєво на партнерський рахунок автоматично, як тільки вони запросять виплату. Це стосуватиметься методів виплат Stripe, PayPal і Store Credit.','With this enabled, "administrator" users will be able to fill out the affiliate registration form for new users (custom username/email etc), whilst logged in.'=>'Увімкнувши цю опцію, користувачі «адміністратора» зможуть заповнювати реєстраційну форму партнера для нових користувачів (користувацьке ім\'я користувача/електронна пошта тощо), увійшовши в систему.','With this enabled, a hidden field will be added to the registration form to help prevent spam.'=>'Якщо ввімкнути цю функцію, до форми реєстрації буде додано приховане поле, яке допоможе запобігти спаму.','With this enabled, a new "Affiliate" link will appear on the users "My Account" page menu. This will take them to the affiliate dashboard page selected above.'=>'Якщо цю функцію включено, в меню сторінки «Мій квиток» користувача з\'явиться нове посилання «Партнер». Це приведе їх на сторінку інформаційної панелі партнера, вибрану вище.','With this enabled, a new "Upload Invoice" option will be displayed above the "Request Payout" button on the "Payouts" tab. They can click this to upload their PDF invoice for the payout, then submit their payout request.'=>'Якщо це ввімкнено, нова опція "Завантажити рахунок-фактуру" буде відображатися над кнопкою "Запит на виплату" на вкладці "Виплати". Вони можуть натиснути цю кнопку, щоб завантажити свій рахунок-фактуру у форматі PDF для виплати, а потім надіслати запит на виплату.','With this enabled, a second password field will be shown to require users to confirm their password.'=>'Якщо цей параметр увімкнено, буде показано друге поле пароля, яке вимагатиме від користувачів підтвердити свій пароль.','With this enabled, admin accounts will also be able to view the "payouts" tab when viewing any of the affiliate coupon dashboard pages.'=>'Увімкнувши це, облікові записи адміністраторів також зможуть переглядати вкладку «виплати» під час перегляду будь-якої зі сторінок інформаційної панелі партнерських купонів.','With this enabled, affiliate registrations will be automatically accepted (and coupon auto-created instantly), instead of manual approval.'=>'Якщо ввімкнути цю опцію, реєстрації партнерів будуть прийматися автоматично (а купон створюватиметься автоматично миттєво), а не затверджуватися вручну.','With this enabled, affiliate users can click a button to automatically generate a short URL for their referral link.'=>'Увімкнувши це, афілійовані користувачі можуть натиснути кнопку, щоб автоматично згенерувати коротку URL-адресу для свого реферального посилання.','With this enabled, affiliate users can click a button to generate a QR code for their referral link.'=>'Увімкнувши це, афілійовані користувачі можуть натиснути кнопку, щоб згенерувати QR-код для свого реферального посилання.','With this enabled, affiliate users can link their website domain to their coupon.'=>'Увімкнувши це, афілійовані користувачі можуть пов\'язати домен свого веб-сайту зі своїм купоном.','With this enabled, all renewals for subscriptions will also be rewarded commission (if the affiliate referred the customer) and renewal orders displayed on the dashboard.'=>'Якщо ввімкнути цю функцію, на всі продовження підписок також буде виплачена комісія (якщо партнер направив клієнта) і замовлення на продовження, що відображаються на інформаційній панелі.','With this enabled, if someone follows a referral link and registers (creates an account), they will then be linked to that affiliate, even without initially placing an order.'=>'Якщо цю функцію ввімкнено, якщо хтось перейде за реферальним посиланням і зареєструється (створить обліковий запис), він буде пов\'язаний з цією афіліатною особою, навіть без початкового розміщення замовлення.','With this enabled, in the "referral URL" section your affiliates will be able to create "campaigns", to generate custom URLs, track clicks, sales, conversation rate for specific referral campaigns.'=>'Увімкнувши це, у розділі «реферальна URL-адреса» ваші партнери зможуть створювати «кампанії», генерувати користувацькі URL-адреси, відстежувати кліки, продажі, частоту розмов для конкретних реферальних кампаній.','With this enabled, instead of the user entering their "preferred coupon code", a code will be generated for them automatically.'=>'Якщо цей параметр увімкнено, замість того, щоб користувач вводив свій «бажаний код купона», для нього автоматично буде згенеровано код.','With this enabled, instead of using the default WordPress "subscriber" user role, new affiliate users will be assigned to the custom "coupon affiliate" user role (or the custom role defined below) instead.'=>'Якщо цю функцію ввімкнено, замість використання ролі користувача WordPress "subscriber" за замовчуванням, новим афілійованим користувачам буде призначено спеціальну роль користувача "coupon affiliate" (або користувацьку роль, визначену нижче).','With this enabled, it will permanently save and use the commission rate that was set at the time the order is created, even if you update the rates below.'=>'Якщо ввімкнути цю функцію, він постійно зберігатиме та використовуватиме ставку комісії, яка була встановлена на момент створення замовлення, навіть якщо ви оновите тарифи нижче.','With this enabled, logged out users can view the registration form (with some extra fields). When submitted it will create a new account for them, and submit the affiliate application.'=>'Якщо цю опцію увімкнено, користувачі, які не ввійшли в систему, можуть переглядати форму реєстрації (з деякими додатковими полями). Після надсилання він створить для них новий обліковий запис і надішле заявку на партнерство.','With this enabled, multiple template coupons will be available and the affiliate will be able to choose which type they want via the registration form.'=>'Якщо ввімкнути це, буде доступно кілька шаблонних купонів, і партнер зможе вибрати, який тип він хоче, за допомогою форми реєстрації.','With this enabled, some of the fields on the form will be displayed in 2 columns, such as first and last name.'=>'Якщо цей параметр увімкнено, деякі поля у формі будуть відображатися у 2 стовпцях, наприклад, ім\'я та прізвище.','With this enabled, the affiliate can only request a payout if they have attached an invoice (PDF file).'=>'Увімкнувши цю функцію, партнер може запросити виплату лише в тому випадку, якщо він прикріпив рахунок-фактуру (PDF-файл).','With this enabled, the first ever payout request by an affiliate will require manual approval. After they have at-least 1 completed payout, all future payouts can be paid automatically.'=>'Якщо цю функцію ввімкнено, перший в історії запит на виплату від партнера вимагатиме схвалення вручну. Після того, як вони матимуть принаймні 1 завершену виплату, усі майбутні виплати можуть бути виплачені автоматично.','With this enabled, the first name and last name fields will be required.'=>'Якщо цей параметр увімкнено, будуть обов\'язковими поля імені та прізвища.','With this enabled, the link will be hidden for users that are not assigned to a coupon.'=>'Якщо ввімкнути цю опцію, посилання буде приховано для користувачів, яким не призначено купон.','With this enabled, the new user account created will be assigned to the default "Subscriber" role (or the custom role defined below) initially, and only when their affiliate application is accepted will they be assigned to the "coupon affiliate" user role instead.'=>'Якщо цю функцію увімкнено, новий створений обліковий запис користувача спочатку буде призначено ролі «Передплатник» за замовчуванням (або користувацькій ролі, визначеній нижче), і лише коли їхня партнерська заявка буде прийнята, замість цього їм буде призначено роль користувача «партнерська програма з купоном».','With this enabled, the pending user role will be removed from the affiliate when the application is accepted.'=>'Якщо ввімкнути цю функцію, роль користувача, що очікує на розгляд, буде видалена з партнерської програми, коли заявка буде прийнята.','With this enabled, the username field will be hidden, and the email address will be used as their username instead.'=>'Якщо цей параметр увімкнено, поле імені користувача буде приховано, а замість нього буде використовуватися адреса електронної пошти як ім\'я користувача.','With this enabled, when adding a new domain, affiliates will be able to select a "campaign" to assign that domains referrals to.'=>'Увімкнувши цю функцію, при додаванні нового домену партнери зможуть вибрати «кампанію» для призначення цих доменів, на які направляють респондентів.','With this enabled, when the "Affiliate" tab is clicked, instead of redirecting to the normal affiliate dashboard page, it will show the affiliate dashboard as a page/section within "My Account".'=>'Якщо це ввімкнено, коли натискається вкладка «Партнер», замість перенаправлення на звичайну сторінку інформаційної панелі партнера, вона відображатиме інформаційну панель партнера як сторінку/розділ у «Моєму обліковому записі».','With this enabled, you will be able assign a user role to a template coupon, so when someone registers via that template option, they will also be assigned to this user role.'=>'Увімкнувши цю опцію, ви зможете призначити роль користувача шаблонному купону, тому, коли хтось реєструється за допомогою цієї опції шаблону, він також буде призначений цій ролі користувача.','With this feature, you can enable an option to prevent ALL affiliate coupons and referral links from working UNLESS the customer was directly linked by the approved domain that is assigned to that coupon.'=>'За допомогою цієї функції ви можете ввімкнути опцію запобігання роботі ВСІХ партнерських купонів і реферальних посилань, ЯКЩО клієнт не був безпосередньо пов\'язаний затвердженим доменом, який призначений цьому купону.','WooCommerce coupons list'=>'Список купонів WooCommerce','WooCommerce Subscriptions Settings'=>'Налаштування підписок WooCommerce','WooCommerce – Integration Guide'=>'WooCommerce – Посібник з інтеграції','Would you like to set the new signup promo page as the default registration page?'=>'Чи хотіли б ви встановити нову промо-сторінку реєстрації як сторінку реєстрації за замовчуванням?','Year (optional):'=>'Рік (необов\'язково):','Yes'=>'Так','Yes, you can view the dashboard for each of your affiliates\' coupons by going to the <a href="%s" target="_blank">coupons page</a> and click the "Dashboard" link.'=>'Так, ви можете переглянути інформаційну панель для кожного з купонів ваших партнерів, перейшовши на <a href="%s" target="_blank">сторінку купонів</a> і натиснувши посилання «Інформаційна панель».','You are all set! Store credit payouts will now be added to the users "%s" wallet automatically in one-click.'=>'Все готово! Кредитні виплати з магазину тепер будуть зараховуватися на гаманець користувача "%s" автоматично в один клік.','You are all set! Store credit payouts will now be added to the users wallet automatically in one-click. They can spend this credit when visiting the cart/checkout.'=>'Все готово! Кредитні виплати з магазину тепер будуть зараховуватися на гаманець користувача автоматично в один клік. Вони можуть витратити цей кредит під час відвідування кошика/каси.','You are already registered as an affiliate.'=>'Ви вже зареєстровані як партнер.','You are sending too many of requests in a short time and have been temporarily timed out.'=>'Ви надсилаєте забагато запитів за короткий час і тимчасово перевищили час очікування.','You can <a href="%s" target="_blank">edit your template coupon</a> if you want to change the default affiliate coupon settings.'=>'Ви можете <a href="%s" target="_blank">відредагувати свій шаблон купона</a> , якщо хочете змінити налаштування партнерського купона за замовчуванням.','You can adjust the horizontal and vertical margins to move the text around. The alignment of the text is centered.'=>'Ви можете налаштувати горизонтальні та вертикальні поля, щоб переміщати текст. Вирівнювання тексту відбувається по центру.','You can also show the logged in affiliates default link anywhere using the shortcode: [couponaffiliates-referral-url]'=>'Ви також можете показати посилання за замовчуванням увійшли в систему афіліатів будь-де, використовуючи шорткод: [couponaffiliates-referral-url]','You can also view a full list of the coupons, with the assigned user, pending payments, and unique affiliate dashboard links for each coupon (to view yourself) on the WooCommerce'=>'Ви також можете переглянути повний список купонів із призначеним користувачем, незавершеними платежами та унікальними посиланнями на партнерську панель для кожного купона (щоб переглянути себе) на WooCommerce','You can apply additional strict fraud prevention with direct link tracking.'=>'Ви можете застосувати додатковий суворий захист від шахрайства за допомогою прямого відстеження посилань.','You can assign a group to an affiliate when adding or editing an affiliate.'=>'Ви можете призначити групу партнеру під час додавання або редагування афіліату.','You can change the Registration Page in "Registration Settings" tab:'=>'Ви можете змінити сторінку реєстрації у вкладці "Налаштування реєстрації":','You can create groups here:'=>'Створити групи можна тут:','You can customise the affiliate portal more, including layout and colors, later on the settings page.'=>'Ви можете більше налаштувати партнерський портал, включаючи макет і кольори, пізніше на сторінці налаштувань.','You can customise the colors of the affiliate portal in the <a %s>design settings tab</a>.'=>'Ви можете налаштувати кольори партнерського порталу у <a %s="">вкладці налаштувань дизайну</a>.','You can customise the content of the generated page template by modifying the fields below.'=>'Ви можете налаштувати вміст згенерованого шаблону сторінки, змінивши поля нижче.','You can customise the form and add your own custom fields via the below settings.'=>'Ви можете налаштувати форму та додати власні користувацькі поля за допомогою наведених нижче налаштувань.','You can customize the plugin to meet your requirements on '=>'Ви можете налаштувати плагін відповідно до ваших вимог на ','You can download MailPoet here:'=>'Завантажити MailPoet можна тут:','You can easily pay your affiliates via a variety of different payout methods including one-click Stripe, PayPal, or Store Credit, along with manual Bank Transfer payouts, or any custom manual payout method of your own. You can even automate payouts to be paid automatically on a scheduled basis, collect invoices, generate PDF statements, and more. <a href="%s" target="_blank">%s</a>'=>'Ви можете легко платити своїм партнерам за допомогою різноманітних методів виплат, включаючи Stripe в один клік, PayPal або Store Credit, а також виплати банківським переказом вручну або будь-який власний метод виплат вручну. Ви навіть можете автоматизувати виплати для автоматичної виплати за розкладом, збирати рахунки-фактури, створювати виписки у форматі PDF тощо. <a href="%s" target="_blank">%s</a>','You can enable line graphs in the "Pro Settings" tab. This will show some nice line graphs on the statistics tab of the affiliate dashboard.'=>'Увімкнути лінійні діаграми можна у вкладці «Pro Settings». Це покаже кілька гарних лінійних графіків на вкладці статистики на інформаційній панелі партнера.','You can enable referral URLs, and customise the settings for these, in the "Referral Links" tab on the settings tab.'=>'Ви можете ввімкнути URL-адреси переходів і налаштувати параметри для них у вкладці «Реферальні посилання» на вкладці налаштувань.','You can enable the "Scheduled Payouts" feature, which will schedule payout requests to be submitted on a regular basis.'=>'Ви можете ввімкнути функцію «Заплановані виплати», яка запланує регулярне подання запитів на виплати.','You can get your API key from here:'=>'Ви можете отримати свій API-ключ звідси:','You can get your API URL from your ActiveCampaign dashboard: Account > Settings > Developer'=>'Ви можете отримати URL-адресу API на інформаційній панелі ActiveCampaign: Обліковий запис > Налаштування > Розробник','You can get your Audience ID from here:'=>'Ідентифікатор аудиторії можна отримати тут:','You can get your Form ID from here:'=>'Ви можете отримати свій ідентифікатор форми тут:','You can get your List ID from here:'=>'Ви можете отримати свій ідентифікатор списку тут:','You can get your List ID from your ActiveCampaign dashboard: Contacts > Lists > Click on the list > View the ID in the URL ("listid").'=>'Ви можете отримати ідентифікатор списку на інформаційній панелі ActiveCampaign: Контакти > списки > Натисніть на список > Переглянути ідентифікатор в URL («listid»).','You can get your List Token from here:'=>'Ви можете отримати свій токен списку звідси:','You can get your private API key from here:'=>'Ви можете отримати свій приватний API ключ звідси:','You can get your site key and secret key from here:'=>'Ви можете отримати свій ключ сайту та секретний ключ звідси:','You can however customise this below if required:'=>'Однак ви можете налаштувати це нижче, якщо потрібно:','You can manage the user roles/groups that are assigned to the template coupons in the "Registrations" settings tab of the Coupon Affiliates settings.'=>'Ви можете керувати ролями/групами користувачів, які призначені шаблонним купонам у вкладці налаштувань "Реєстрації" налаштувань Coupon Affiliates.','You can manually create an affiliate by <a href="%s" target="_blank">clicking here</a>.<br/><br/>You can add either an existing or new user. Alternatively, you can also link users to your <a href="%s" target="_blank">affiliate registration page</a> to submit an affiliate application. When an affiliate user is added, this will automatically create the affiliate coupon, assign the user to it, and send them a link to the affiliate dashboard. <a href="%s" target="_blank">Learn more about affiliate registration.</a>'=>'Ви можете створити партнерку вручну, <a href="%s" target="_blank">натиснувши тут</a>.<br/><br/>Ви можете додати існуючого або нового користувача. Крім того, ви також можете прив\'язати користувачів до вашої <a href="%s" target="_blank">сторінки реєстрації партнера</a> , щоб подати заявку на партнерство. Коли додається партнерський користувач, це автоматично створить партнерський купон, призначить користувача до нього та надішле їм посилання на інформаційну панель партнера. <a href="%s" target="_blank">Дізнайтеся більше про реєстрацію партнера.</a>','You can now give access to the MLA Dashboard for specific affiliate users. To do this, edit the user and enable "MLA Dashboard Access".'=>'Тепер ви можете надати доступ до панелі MLA Dashboard конкретним афілійованим користувачам. Для цього відредагуйте користувача та включіть "MLA Dashboard Access".','You can set fixed commission amounts (either per order, or per product), alongside percentage of the total order. You can set all 3 of these for a combined total if required.'=>'Ви можете встановити фіксовані суми комісії (за замовлення або за продукт), а також відсоток від загальної суми замовлення. Ви можете встановити всі 3 з них для комбінованої суми, якщо це необхідно.','You can set the global commission rates for all coupons in the <a href="%s">plugin settings</a> page.'=>'Ви можете встановити глобальні ставки комісії для всіх купонів на сторінці <a href="%s">налаштувань плагіна</a> .','You can set your custom commission rates in the "commission" tab of the'=>'Ви можете встановити свої спеціальні ставки комісії у вкладці «комісія»','You can then customise the the page further after it is generated, by editing the page itself.'=>'Потім ви можете налаштувати сторінку після її створення, відредагувавши саму сторінку.','You can track and manage payouts on the'=>'Ви можете відстежувати та керувати виплатами на','You can update the tier 1 affiliate (who invited this user). All other tiers will be updated automatically based on that affiliates network.'=>'Ви можете оновити афіліату рівня 1 (який запросив цього користувача). Усі інші рівні будуть оновлюватися автоматично залежно від цієї партнерської мережі.','You can use the terms and conditions manager and generation tool to help you easily create your terms and conditions page.'=>'Ви можете використовувати менеджер умов та інструмент генерації, щоб легко створити сторінку з умовами та положеннями.','You cannot clone instances of %s.'=>'Ви не можете клонувати екземпляри %s.','You cannot unserialize instances of %s.'=>'Ви не можете скасувати серіалізацію екземплярів %s.','You currently have scheduled payouts enabled. This will automatically submit payout requests for all affiliates with more than'=>'Наразі у вас увімкнено заплановані виплати. Це автоматично призведе до подання запитів на виплати всім партнерам із понад ніж','You don\'t currently have any sub-affiliates.'=>'Наразі у вас немає суб-філій.','You don\'t have any completed commission payments yet.'=>'У вас ще немає завершених комісійних платежів.','You don\'t have any pending commission payments.'=>'У вас немає незавершених платежів за комісію.','You have a pending affiliate application.'=>'У вас є незавершена партнерська заявка.','You have a Pro license! Please deactivate the FREE version and install the PRO version instead to enable the new functionality.'=>'У вас є ліцензія Pro! Будь ласка, вимкніть БЕЗКОШТОВНУ версію та встановіть замість неї PRO-версію, щоб увімкнути нову функцію.','You have earned a reward!'=>'Ви заслужили нагороду!','You have made a new referral sale!'=>'Ви здійснили новий реферальний продаж!','You must be logged in to view the MLA dashboard.'=>'Ви повинні увійти в систему, щоб переглянути приладну дошку MLA.','You should only disable this if your primary method of tracking referrals is through customers manually applying the affiliates coupon at checkout.'=>'Ви повинні вимкнути це лише в тому випадку, якщо ваш основний метод відстеження рефералів полягає в ручному застосуванні клієнтами купона від партнерів під час оформлення замовлення.','You will be able to customise more group settings once it has been added.'=>'Ви зможете налаштувати більше параметрів групи після його додавання.','You will be able to customise more options in the <a href="%s" target="_blank">settings page</a> later.'=>'Пізніше ви зможете налаштувати більше параметрів на <a href="%s" target="_blank">сторінці налаштувань</a> .','You will just need to use the shortcode:'=>'Вам просто потрібно буде скористатися шорткодом:','You will still be able to review and edit the generated code before approving.'=>'Ви все одно зможете переглянути та відредагувати згенерований код перед затвердженням.','You\'re almost ready to launch your affiliate program, and start growing your revenue!'=>'Ви майже готові запустити свою партнерську програму та почати збільшувати свій дохід!','Your Account'=>'Ваш обліковий запис','Your affiliate application for the coupon code "{coupon}" has been submitted. Please check your email.'=>'Ваша партнерська заявка на отримання коду купона "{coupon}" була подана. Будь ласка, перевірте свою електронну пошту.','Your affiliate application has been submitted.'=>'Ваша партнерська заявка була подана.','Your affiliate network:'=>'Ваша партнерська мережа:','Your Affiliate Program signup promo page has been created. You can update it or view it below.'=>'Ваша промо-сторінка реєстрації в партнерській програмі створена. Ви можете оновити його або переглянути нижче.','Your affiliate users can manage and manually submit their own payout by visiting the "Payouts" tab on their affiliate dashboard.'=>'Ваші афілійовані користувачі можуть керувати та вручну надсилати власні виплати, відвідавши вкладку "Виплати" на інформаційній панелі свого партнера.','Your Commission'=>'Ваша комісія','Your latest invites:'=>'Ваші останні запрошення:','Your PRO license has expired. Access to some PRO features may now be limited. Please upgrade again to re-activate PRO features.'=>'Термін дії вашої ліцензії PRO закінчився. Доступ до деяких PRO-функцій тепер може бути обмежений. Будь ласка, оновіться ще раз, щоб повторно активувати PRO-функції.','Your referred order #{id} has been cancelled.'=>'Ваше замовлення #{id} було скасовано.','Your sub-affiliate coupons:'=>'Ваші субпартнерські купони:','Your users can become super-affiliates and invite other affiliates to be a part of their network. They will then earn extra commission from all their referrals.'=>'Ваші користувачі можуть стати супер-партнерами та запрошувати інших партнерів стати частиною їхньої мережі. Потім вони зароблятимуть додаткову комісію з усіх своїх рефералів.','Your Website'=>'Ваш веб-сайт','YouTube URL:'=>'Адреса YouTube:','{number} New Payout Requests'=>'{кількість} Нові запити на виплати','✓ This page is currently set as the default registration Page.'=>'✓ Ця сторінка в даний час встановлена як сторінка реєстрації за замовчуванням.']];
